INSERT INTO "parameter" VALUES(1,'conductivity',11,1,NULL,36,7,'Seawater Conductivity','sea_water_electrical_conductivity',6,NULL,NULL,'CONDWAT_L1','Seawater conductivity refers to the ability of seawater to conduct electricity. The presence of ions in the seawater, such as salt, increases the electrical conducting ability of seawater. As such, conductivity can be used as a proxy for determining the quantity of salt in a sample of seawater. Units: S m-1',3,1);
INSERT INTO "parameter" VALUES(2,'pressure',11,1,NULL,80,7,'Seawater Pressure','sea_water_pressure',3,NULL,NULL,'PRESWAT_L1','Seawater Pressure refers to the pressure exerted on a sensor in situ by the weight of the column of seawater above it. It is calculated by subtracting one standard atmosphere from the absolute pressure at the sensor to remove the weight of the atmosphere on top of the water column. The pressure at a sensor in situ provides a metric of the depth of that sensor. Units: dbar',3,1);
INSERT INTO "parameter" VALUES(3,'salinity',11,1,NULL,8,7,'Practical Salinity','sea_water_practical_salinity',3,NULL,NULL,'PRACSAL_L2','Salinity is generally defined as the concentration of dissolved salt in a parcel of seawater. Practical Salinity is a more specific unitless quantity calculated from the conductivity of seawater and adjusted for temperature and pressure. It is approximately equivalent to Absolute Salinity (the mass fraction of dissolved salt in seawater) but they are not interchangeable. Units: unitless',3,2);
INSERT INTO "parameter" VALUES(4,'temperature',11,1,NULL,91,7,'Seawater Temperature','sea_water_temperature',4,NULL,NULL,'TEMPWAT_L1','Seawater temperature near the sensor. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(5,'density',10,1,NULL,124,7,'Seawater Density','sea_water_density',3,27,'{"lat": "CC_lat", "p": "dpi_PRESWAT_L1", "SP": "dpi_PRACSAL_L2", "lon": "CC_lon", "t": "dpi_TEMPWAT_L1"}','DENSITY_L2','Seawater Density is defined as mass per unit volume and is calculated from the conductivity, temperature and depth of a seawater sample using the TEOS-10 equation. Units: kg m-3.',3,2);
INSERT INTO "parameter" VALUES(6,'temp',11,1,NULL,91,7,'Seawater Temperature','sea_water_temperature',4,NULL,NULL,'TEMPWAT_L1','Seawater temperature near the sensor. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(7,'time',11,2,NULL,204,7,'Time, UTC','time',NULL,NULL,NULL,NULL,'Time, UTC',NULL,NULL);
