INSERT INTO "parameter" VALUES(12,'internal_timestamp',11,2,NULL,204,7,'Internal Timestamp, UTC',NULL,NULL,NULL,NULL,NULL,'Internal timestamp, UTC',NULL,NULL);
INSERT INTO "parameter" VALUES(13,'practical_salinity',10,1,NULL,8,7,'Practical Salinity','sea_water_practical_salinity',4,26,'{"p": "dpi_PRESWAT_L1", "c": "dpi_CONDWAT_L1", "t": "dpi_TEMPWAT_L1"}','PRACSAL_L2','Salinity is generally defined as the concentration of dissolved salt in a parcel of seawater. Practical Salinity is a more specific unitless quantity calculated from the conductivity of seawater and adjusted for temperature and pressure. It is approximately equivalent to Absolute Salinity (the mass fraction of dissolved salt in seawater) but they are not interchangeable. Units: unitless',3,2);
INSERT INTO "parameter" VALUES(14,'dissolved_oxygen',10,1,NULL,240,7,'Dissolved Oxygen Concentration','moles_of_oxygen_per_unit_mass_in_sea_water',4,61,'{"DO": "dpi_DOCONCS_L1", "SP": ["dpi_PRACSAL_L2", "dpi_SALSURF_L2"], "lon": "CC_lon", "P": ["dpi_PRESWAT_L1", "PD17"], "T": ["dpi_TEMPWAT_L1", "dpi_TEMPSRF_L1"], "lat": "CC_lat"}','DOXYGEN_L2','Dissolved Oxygen Concentration from the Stable Response Dissolved Oxygen Instrument is a measure of the concentration of gaseous oxygen mixed in seawater. This data product is corrected for salinity, temperature, and depth. Units: mol kg-1.',3,2);
