INSERT INTO "parameter" VALUES(18,'salinity_corrected_nitrate',10,1,NULL,239,7,'Nitrate Concentration - Temp and Sal Corrected',NULL,NULL,109,'{"ctd_t": ["dpi_TEMPWAT_L1", "dpi_TEMPSRF_L1"], "di": "CC_di", "frame_type": "PD311", "cal_temp": "CC_cal_temp", "wl": "CC_wl", "eswa": "CC_eswa", "data_in": "PD332", "wllower": "CC_lower_wavelength_limit_for_spectra_fit", "wlupper": "CC_upper_wavelength_limit_for_spectra_fit", "eno3": "CC_eno3", "ctd_sp": ["dpi_PRACSAL_L2", "dpi_SALSURF_L2"], "dark_value": ["PD330", "PD2325"]}','NITRTSC_L2','Temperature and salinity corrected dissolved nitrate concentration. Units: mol L-1.',3,2);
INSERT INTO "parameter" VALUES(19,'beam_attenuation',10,1,NULL,132,7,'Optical Beam Attenuation Coefficient',NULL,6,51,'{"tc_arr": "CC_tcarray", "PS": ["dpi_PRACSAL_L2", "dpi_SALSURF_L2"], "T": ["dpi_TEMPWAT_L1", "dpi_TEMPSRF_L1"], "traw": "PD590", "tbins": "CC_tbins", "cref": "PD595", "csig": "PD597", "tcal": "CC_tcal", "coff": "CC_ccwo", "cwl": "CC_cwlngth"}','OPTATTN_L2','The Optical Beam Attenuation Coefficient is the rate that the intensity of a beam of light will decrease in response to the combined effects of absorption and scatter as a function of propagation distance. The Attenuation Coefficient results from the spectral beam attenuation of the combination of all seawater impurities including all particulate and dissolved matter of optical importance. Units: m-1',3,2);
INSERT INTO "parameter" VALUES(20,'optical_absorption',10,1,NULL,132,7,'Optical Absorption Coefficient',NULL,6,52,'{"aref": "PD596", "PS": ["dpi_PRACSAL_L2", "dpi_SALSURF_L2"], "aoff": "CC_acwo", "asig": "PD598", "cpd_ts": "dpi_OPTATTN_L2", "T": ["dpi_TEMPWAT_L1", "dpi_TEMPSRF_L1"], "traw": "PD590", "awl": "CC_awlngth", "cwl": "CC_cwlngth", "tbins": "CC_tbins", "tcal": "CC_tcal", "ta_arr": "CC_taarray"}','OPTABSN_L2','Optical Absorption Coefficient is the rate that the intensity of a beam of light will decrease in response to the absorption (removal) of light energy as a function of propagation distance. The Optical Absorption Coefficient reflects the absorption coefficient for the combination of all seawater impurities including all particulate and dissolved matter of optical importance. Units: m-1',3,2);
INSERT INTO "parameter" VALUES(21,'seawater_scattering_coefficient',10,1,NULL,132,7,'Total Scattering Coefficient of Pure Seawater',NULL,4,97,'{"delta": "CC_depolarization_ratio", "theta": "CC_scattering_angle", "wlngth": "CC_measurement_wavelength", "degC": ["dpi_TEMPWAT_L1", "dpi_TEMPSRF_L1"], "psu": ["dpi_PRACSAL_L2", "dpi_SALSURF_L2"]}',NULL,'Total scattering coefficient of pure seawater. Units: m-1.',3,2);
INSERT INTO "parameter" VALUES(22,'fluorometric_chlorophyll_a',10,1,NULL,235,7,'Chlorophyll-a Concentration','mass_concentration_of_chlorophyll_a_in_sea_water',6,80,'{"counts_dark": "CC_dark_counts_chlorophyll_a", "scale_factor": "CC_scale_factor_chlorophyll_a", "counts_output": "dpi_CHLAFLO_L0"}','CHLAFLO_L1','Fluorometric Chlorophyll-a Concentration is an estimate of phytoplankton biomass using fluorescence. The fluorometer emits light at a specific wavelength that is absorbed by chlorophyll and re-emitted as light at a different wavelength. By measuring the intensity of the re-emitted wavelength of light the chlorophyll-a concentration in the surrounding seawater can be estimated. Chlorophyll-a concentrations can be used as a proxy for phytoplankton biomass as it is a dominant photosynthetic pigment. Units: g L-1.',3,1);
INSERT INTO "parameter" VALUES(23,'fluorometric_cdom',10,1,NULL,189,7,'CDOM Concentration',NULL,6,79,'{"counts_dark": "CC_dark_counts_cdom", "scale_factor": "CC_scale_factor_cdom", "counts_output": "PD1143"}','CDOMFLO_L1','Fluorometric CDOM Concentration is a measure of how much light has been re-emitted (fluoresced) from colored organic compounds found in the colored dissolved organic matter (CDOM) in seawater. Examples of CDOM include tannins (polyphenols that bind to proteins and other large molecules) or lignins (polymers of phenolic acids) from decaying plant material and byproducts from the decomposition of animals. It accounts for the tea-like color in seawater. CDOM is not particulate, but seawater can contain both CDOM and turbidity. Units: ppb',3,1);
INSERT INTO "parameter" VALUES(24,'total_volume_scattering_coefficient',10,1,NULL,133,7,'Total Volume Scattering Coefficient',NULL,6,81,'{"counts_dark": "CC_dark_counts_volume_scatter", "scale_factor": "CC_scale_factor_volume_scatter", "counts_output": "dpi_FLUBSCT_L0"}','FLUBSCT_L1','Total Volume Scattering Coefficient values represent the volume scattering from particles and the molecular scattering from water at a given wavelength of light and the default angle of 117 degrees for the ECO meter. Units: m-1 sr-1',NULL,1);
INSERT INTO "parameter" VALUES(25,'optical_backscatter',10,1,NULL,132,7,'Optical Backscatter',NULL,4,78,'{"beta": "dpi_FLUBSCT_L1", "degC": ["dpi_TEMPWAT_L1", "dpi_TEMPSRF_L1"], "theta": "CC_scattering_angle", "wlngth": "CC_measurement_wavelength", "xfactor": "CC_angular_resolution", "psu": ["dpi_PRACSAL_L2", "dpi_SALSURF_L2"]}','FLUBSCT_L2','Optical Backscatter (Red Wavelengths) is a measure of the amount of red light (630-740 nm wavelengths) scattered in the backward direction due to suspended matter within seawater, providing a proxy for turbidity and suspended solids. Units: m-1',3,2);
