INSERT INTO "parameter" VALUES(188,'par',11,10,NULL,66,10,'PAR Measurement',NULL,0,NULL,NULL,'OPTPARW_L0','Photosynthetically Active Radiation (PAR) unprocessed sensor reading. Units: counts',4,0);
INSERT INTO "parameter" VALUES(192,'par_counts_output',10,1,NULL,222,8,'Photosynthetically Active Radiation','downwelling_photosynthetic_photon_flux_in_sea_water',4,83,'{"a1": "CC_a1", "a0": "CC_a0", "Im": "CC_Im", "counts_output": "PD188"}','OPTPARW_L1','Photosynthetically Active Radiation (PAR) is the measure of the density of photons per unit area that are in the spectral range of light (400-700 nanometers) that primary producers use for photosynthesis. Units: umol photons m-2 s-1',3,1);
INSERT INTO "parameter" VALUES(193,'temperature',11,4,NULL,66,7,'Seawater Temperature Measurement',NULL,0,NULL,NULL,'TEMPWAT_L0','Seawater temperature unprocessed measurement near the sensor. Units: counts',4,0);
INSERT INTO "parameter" VALUES(194,'conductivity',11,4,NULL,66,7,'Seawater Conductivity Measurement',NULL,0,NULL,NULL,'CONDWAT_L0','Seawater conductivity refers to the ability of seawater to conduct electricity. The presence of ions in the seawater, such as salt, increases the electrical conducting ability of seawater. As such, conductivity can be used as a proxy for determining the quantity of salt in a sample of seawater. This is the unprocessed data that are output directly from the sensor which are then converted to salinity in S m-1. Units: counts',4,0);
INSERT INTO "parameter" VALUES(195,'pressure',11,4,NULL,66,7,'Seawater Pressure Measurement',NULL,0,NULL,NULL,'PRESWAT_L0','Seawater Pressure refers to the pressure exerted on a sensor in situ by the weight of the column of seawater above it. It is calculated by subtracting one standard atmosphere from the absolute pressure at the sensor to remove the weight of the atmosphere on top of the water column. The pressure at a sensor in situ provides a metric of the depth of that sensor. This is the unprocessed data that are output directly from the sensor which are then converted to pressure in dbar. Units: counts',4,0);
INSERT INTO "parameter" VALUES(196,'pressure_temp',11,4,NULL,66,7,'Seawater Pressure Measurement',NULL,0,NULL,NULL,NULL,'Seawater Pressure refers to the pressure exerted on a sensor in situ by the weight of the column of seawater above it. It is calculated by subtracting one standard atmosphere from the absolute pressure at the sensor to remove the weight of the atmosphere on top of the water column. The pressure at a sensor in situ provides a metric of the depth of that sensor. This is the unprocessed data that are output directly from the sensor which are then converted to pressure in dbar. Units: counts',NULL,NULL);
INSERT INTO "parameter" VALUES(197,'oxygen',11,4,NULL,66,7,'DO Measurement',NULL,0,NULL,NULL,'DOCONCS-CNT_L0','Dissolved Oxygen (DO) unprocessed measurement from the Stable Response Dissolved Oxygen Instrument. Units: counts',4,0);
