INSERT INTO "parameter" VALUES(421,'resistivity_5',11,1,NULL,38,7,'Resistivity V1',NULL,3,NULL,NULL,'TRHPHR1_L0','Raw resistivity voltage at 1x gain. This parameter is one of three resistivity data values that may be used to compute the Vent Fluid Chloride Concentration. The potential across the resistivity electrodes is amplified using three different circuits, resulting in three data values between 0-4V reflecting gains of 1- 5 and 25. The data-product computation chooses the most highly resolved, on-scale, resistivity data value and assigns a chloride concentration based on that value.',4,0);
INSERT INTO "parameter" VALUES(422,'resistivity_x1',11,1,NULL,38,7,'Resistivity V2',NULL,3,NULL,NULL,'TRHPHR2_L0','Raw resistivity voltage at 5x gain. This parameter is one of three resistivity data values that may be used to compute the Vent Fluid Chloride Concentration. The potential across the resistivity electrodes is amplified using three different circuits, resulting in three data values between 0-4V reflecting gains of 1- 5 and 25. The data-product computation chooses the most highly resolved, on-scale, resistivity data value and assigns a chloride concentration based on that value.',NULL,0);
INSERT INTO "parameter" VALUES(423,'resistivity_x5',11,1,NULL,38,7,'Resistivity V3',NULL,3,NULL,NULL,'TRHPHR3_L0','Raw resistivity voltage at 25x gain. This parameter is one of three resistivity data values that may be used to compute the Vent Fluid Chloride Concentration. The potential across the resistivity electrodes is amplified using three different circuits, resulting in three data values between 0-4V reflecting gains of 1- 5 and 25. The data-product computation chooses the most highly resolved, on-scale, resistivity data value and assigns a chloride concentration based on that value',NULL,0);
