INSERT INTO "parameter" VALUES(427,'eh_sensor',11,1,NULL,38,7,'Vent Fluid Oxidation Reduction-Potential Measurement',NULL,3,NULL,NULL,'TRHPHVO_L0','Oxidation-Reduction Potential Measurement is the tendency of a vent fluid, and the chemical species within it, to acquire electrons (i.e. be reduced). The more positive the potential, the greater the affinity for electrons and tendency to be reduced. Used to calculate Vent Fluid Oxidation-Reduction Potential (ORP). Units: Volts',NULL,0);
INSERT INTO "parameter" VALUES(428,'ref_temp_volts',11,1,NULL,38,7,'Reference Thermistor Temperature Measurement',NULL,3,NULL,NULL,'TRHPHVS_L0','The Reference Thermistor Temperature is measured by the Temperature-Resistivity Probe Instrument and used to calculate Vent Fluid Temperature from TRHPH. Units: Volts',4,0);
