INSERT INTO "parameter" VALUES(441,'velocity_beam1',11,3,NULL,176,5,'Eastward Mean Point Seawater Velocity',NULL,NULL,NULL,NULL,'VELPTMN-VLE_L0','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the eastward component of mean point seawater velocity in earth coordinates relative to true north (accounted for magnetic variation). Units: mm s-1',4,0);
INSERT INTO "parameter" VALUES(442,'velocity_beam2',11,3,NULL,176,5,'Northward Mean Point Seawater Velocity',NULL,NULL,NULL,NULL,'VELPTMN-VLN_L0','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the northward component of mean point seawater velocity in earth coordinates relative to true north (accounted for magnetic variation). Units: mm s-1',4,0);
INSERT INTO "parameter" VALUES(443,'velocity_beam3',11,3,NULL,176,5,'Upward Mean Point Seawater Velocity',NULL,NULL,NULL,NULL,'VELPTMN-VLU_L0','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the upward component of mean point seawater velocity. Units: mm s-1',4,0);
