INSERT INTO "parameter" VALUES(539,'turbulent_velocity_east',11,1,NULL,62,7,'Eastward Turbulent Point Seawater Velocity','eastward_sea_water_velocity',1,NULL,NULL,'VELPTTU-VLE_L0','Turbulent Point Water Velocity is the measurement of current velocity, which can be used to derive turbulence data. Current velocity is measured within a 1 cm3 box by transmitting a sound pulse from the center transducer. The instrument measures the Doppler shift introduced by the reflections from particles suspended in the water, which is picked up by the 3 receivers that surround the center transducer. This data product is the eastward component of turbulent seawater velocity in earth coordinates relative to magnetic North. Units: cm s-1',4,0);
INSERT INTO "parameter" VALUES(540,'turbulent_velocity_north',11,1,NULL,62,7,'Northward Turbulent Point Seawater Velocity','northward_sea_water_velocity',1,NULL,NULL,'VELPTTU-VLN_L0','Turbulent Point Water Velocity is the measurement of current velocity, which can be used to derive turbulence data. Current velocity is measured within a 1 cm3 box by transmitting a sound pulse from the center transducer. The instrument measures the Doppler shift introduced by the reflections from particles suspended in the water, which is picked up by the 3 receivers that surround the center transducer. This data product is the northward component of turbulent seawater velocity in earth coordinates relative to magnetic North. Units: cm s-1',4,0);
INSERT INTO "parameter" VALUES(541,'turbulent_velocity_up',11,1,NULL,62,7,'Upward Turbulent Point Seawater Velocity','upward_sea_water_velocity',1,NULL,NULL,'VELPTTU-VLU_L0','Turbulent Point Water Velocity is the measurement of current velocity, which can be used to derive turbulence data. Current velocity is measured within a 1 cm3 box by transmitting a sound pulse from the center transducer. The instrument measures the Doppler shift introduced by the reflections from particles suspended in the water, which is picked up by the 3 receivers that surround the center transducer. This data product is the upward component of turbulent seawater velocity in earth coordinates. Units: cm s-1',4,0);
