INSERT INTO "parameter" VALUES(551,'turbulent_velocity_east',11,3,NULL,176,5,'Eastward Turbulent Point Seawater Velocity',NULL,3,NULL,NULL,'VELPTTU-VLE_L0','Turbulent Point Water Velocity is the measurement of current velocity, which can be used to derive turbulence data. Current velocity is measured within a 1 cm3 box by transmitting a sound pulse from the center transducer. The instrument measures the Doppler shift introduced by the reflections from particles suspended in the water, which is picked up by the 3 receivers that surround the center transducer. This data product is the unprocessed eastward turbulent point water velocity component. Units: mm s-1',4,0);
