INSERT INTO "parameter" VALUES(837,'sensor_id',11,8,NULL,8,17,'Sensor ID',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
INSERT INTO "parameter" VALUES(838,'time_sync_flag',11,8,NULL,8,17,'Time Sync Flag',NULL,0,NULL,NULL,NULL,'Either ''V'' or ''P''',NULL,NULL);
INSERT INTO "parameter" VALUES(839,'lily_x_tilt',11,1,NULL,226,7,'High-Resolution X-Tilt',NULL,NULL,NULL,NULL,'BOTTILT-XTLT_L0','Seafloor High-Resolution Tilt measurements are very precise measurements of seafloor tilt, measured in micro-radians. This high resolution enables the measurement of the "tilting" of the seafloor as it deforms in response to uplifting mantle at the summit of Axial Volcano. X-tilt is the magnitude of tilt since the last re-leveling of the sensor and is output by the High-resolution Tiltmeter (LILY) on board the BOTPT instrument. Positive X-tilt means the positive x-axis is in the direction of downward tilt. Units: microradians',4,0);
INSERT INTO "parameter" VALUES(840,'lily_y_tilt',11,1,NULL,226,7,'High-Resolution Y-Tilt',NULL,NULL,NULL,NULL,'BOTTILT-YTLT_L0','Seafloor High-Resolution Tilt measurements are very precise measurements of seafloor tilt, measured in micro-radians. This high resolution enables the measurement of the "tilting" of the seafloor as it deforms in response to uplifting mantle at the summit of Axial Volcano. Y-tilt is the magnitude of tilt since the last re-leveling of the sensor and is output by the High-resolution Tiltmeter (LILY) on board the BOTPT instrument. Positive Y-tilt means the positive y-axis is in the direction of downward tilt. Units: microradians',4,0);
INSERT INTO "parameter" VALUES(841,'compass_direction',11,1,NULL,98,7,'High-Resolution Compass Direction',NULL,NULL,NULL,NULL,'BOTTILT-SCMP_L0','The sensor compass direction is output by the High-resolution Tiltmeter (LILY) on board the BOTPT instrument and represents the heading of the negative y-axis direction of the tiltmeter measured in degrees counter-clockwise from north, unorrected for calibration offsets and magnetic declination. Units: integer degrees.',4,0);
INSERT INTO "parameter" VALUES(842,'supply_voltage',11,1,NULL,38,7,'High-Resolution Tiltmeter Voltage',NULL,NULL,NULL,NULL,'TLTVOLT','The auxiliary data product LILY Tiltmeter Voltage is the voltage supplied to the Applied Geomechanics LILY Self-leveling Borehole Tiltmeter sensor. Units: Volts',1,NULL);
INSERT INTO "parameter" VALUES(843,'press_trans_temp',11,2,NULL,91,7,'Nano-Resolution Pressure Transducer Temperature',NULL,NULL,NULL,NULL,'NPTTEMP','Nano-resolution Pressure Transducer Temperature is the internal transducer temperature that is used for onboard temperature-compensation of the pressure measurements produced by the BOTPT instrument. Units: degrees Celsius',1,NULL);
INSERT INTO "parameter" VALUES(844,'heat_x_tilt',11,3,NULL,98,5,'Coarse-Resolution X-Tilt',NULL,0,NULL,NULL,'CRTTILT-XTLT','The auxiliary data product HEAT Coarse-resolution X-Tilt is the sensor tilt in the X direction measured by the ADXL327 Coarse-resolution Tiltmeter sensor integrated with the manual-leveling mechanism on the BOTPT instrument. Units: integer degrees.',1,NULL);
INSERT INTO "parameter" VALUES(845,'heat_y_tilt',11,3,NULL,98,5,'Coarse-Resolution Y-Tilt',NULL,0,NULL,NULL,'CRTTILT-YTLT','The auxiliary data product HEAT Coarse-resolution Y-Tilt is the sensor tilt in the Y direction measured by the ADXL327 Coarse-resolution Tiltmeter sensor integrated with the manual-leveling mechanism on the BOTPT instrument. Units: integer degrees.',1,NULL);
INSERT INTO "parameter" VALUES(846,'iris_x_tilt',11,1,NULL,98,7,'Low-Resolution X-Tilt',NULL,NULL,NULL,NULL,'LRTTILT-XTLT','The auxiliary data product IRIS Low-resolution X-Tilt is the sensor tilt in the X direction. Units: integer degrees.',1,NULL);
INSERT INTO "parameter" VALUES(847,'iris_y_tilt',11,1,NULL,98,7,'Low-Resolution Y-Tilt',NULL,NULL,NULL,NULL,'LRTTILT-YTLT','The auxiliary data product IRIS Low-resolution Y-Tilt is the sensor tilt in the Y direction. Units: integer degrees.',1,NULL);
INSERT INTO "parameter" VALUES(848,'bottom_pressure',11,1,NULL,193,7,'Bottom Pressure',NULL,4,NULL,NULL,'BOTPRES_L1','Seafloor Pressure is a measure of the force on the seafloor exerted by the weight of the overlying water column plus the weight of the atmosphere. Nano-resolution Bottom Pressure measurements are seafloor pressure measurements with very high sample rate and accuracy. This high resolution provides sufficient precision to enable the measurement of the rise and fall of the seafloor. Units: psia',3,1);
INSERT INTO "parameter" VALUES(849,'lily_temp',11,1,NULL,91,7,'High-Resolution Tiltmeter Temperature',NULL,NULL,NULL,NULL,'TLTTEMP','The auxiliary data product LILY Tiltmeter Temperature is the temperature internal to the Applied Geomechanics LILY High-resolution Self-leveling Borehole Tiltmeter sensor. This is considered engineering data that also has scientific value. Units: degrees Celsius',1,NULL);
INSERT INTO "parameter" VALUES(850,'iris_temp',11,1,NULL,91,7,'Low-Resolution Tiltmeter Temperature',NULL,NULL,NULL,NULL,'LRTTEMP','The auxiliary data product IRIS Tiltmeter Temperature is the temperature internal to the IRIS Low-resolution Tiltmeter sensor on the BOTPT instrument. This is considered engineering data that also has scientific value. Units: degrees Celsius',1,NULL);
INSERT INTO "parameter" VALUES(851,'heat_temp',11,3,NULL,91,5,'HEAT Tiltmeter Temperature',NULL,0,NULL,NULL,'CRTTEMP','The auxiliary data product Coarse-resolution Tiltmeter Temperature (or HEAT Internal TiltmeterTemperature) is the internal temperature of the coarse-resolution tiltmeter (ADXL327) sensor on the BOTPT instrument. This is considered engineering data that also has scientific value. Units: degrees Celsius',1,NULL);
INSERT INTO "parameter" VALUES(863,'ingestion_timestamp',11,2,NULL,204,5,'Ingestion Timestamp, UTC',NULL,NULL,NULL,NULL,NULL,'The NTP Timestamp for when the granule was ingested',NULL,NULL);
INSERT INTO "parameter" VALUES(869,'beam_1_velocity',3,3,NULL,176,2,'Beam 1 Velocity Profile',NULL,0,NULL,NULL,'VELPROF-B1_L0','Unprocessed velocity profile from beam 1. Units: mm s-1',4,0);
INSERT INTO "parameter" VALUES(870,'beam_2_velocity',3,3,NULL,176,2,'Beam 2 Velocity Profile',NULL,0,NULL,NULL,'VELPROF-B2_L0','Unprocessed velocity profile from beam 2. Units: mm s-1',4,0);
INSERT INTO "parameter" VALUES(871,'beam_3_velocity',3,3,NULL,176,2,'Beam 3 Velocity Profile',NULL,0,NULL,NULL,'VELPROF-B3_L0','Unprocessed velocity profile from beam 3. Units: mm s-1',4,0);
INSERT INTO "parameter" VALUES(872,'beam_4_velocity',3,3,NULL,176,2,'Beam 4 Velocity Profile',NULL,0,NULL,NULL,'VELPROF-B4_L0','Unprocessed velocity profile from beam 4. Units: mm s-1',4,0);
INSERT INTO "parameter" VALUES(873,'percent_good_beam1',3,12,NULL,187,11,'Beam 1 Percent Good',NULL,0,NULL,NULL,'VELPROF-PCG','Percent good is the fraction of data that has passed quality criteria such as low correlation, large error velocity, and false target threshold. This instance is for beam 1. Units: percent.',NULL,NULL);
INSERT INTO "parameter" VALUES(874,'percent_good_beam2',3,12,NULL,187,11,'Beam 2 Percent Good',NULL,0,NULL,NULL,'VELPROF-PCG','Percent good is the fraction of data that has passed quality criteria such as low correlation, large error velocity, and false target threshold. This instance is for beam 2. Units: percent.',NULL,NULL);
INSERT INTO "parameter" VALUES(875,'percent_good_beam3',3,12,NULL,187,11,'Beam 3 Percent Good',NULL,0,NULL,NULL,'VELPROF-PCG','Percent good is the fraction of data that has passed quality criteria such as low correlation, large error velocity, and false target threshold. This instance is for beam 3. Units: percent.',NULL,NULL);
INSERT INTO "parameter" VALUES(876,'percent_good_beam4',3,12,NULL,187,11,'Beam 4 Percent Good',NULL,0,NULL,NULL,'VELPROF-PCG','Percent good is the fraction of data that has passed quality criteria such as low correlation, large error velocity, and false target threshold. This instance is for beam 4. Units: percent.',NULL,NULL);
INSERT INTO "parameter" VALUES(877,'real_time_clock',3,3,NULL,8,5,'Real Time Clock Array',NULL,0,NULL,NULL,NULL,'Elements of the real-time clock array are: Year, Month, Day, Hour, Minute, Seconds, Hundredths. Units are standard time units, applied to each element respectively (year, month, day, hour, minutes, seconds, cseconds).',NULL,NULL);
INSERT INTO "parameter" VALUES(878,'eastward_turbulent_velocity',10,1,NULL,128,7,'Eastward Turbulent Point Seawater Velocity','eastward_sea_water_velocity',3,53,'{"lat": "CC_lat", "lon": "CC_lon", "u": "PD539", "timestamp": "PD11", "v": "PD540"}','VELPTTU-VLE_L1','Turbulent Point Water Velocity is the measurement of current velocity, which can be used to derive turbulence data. Current velocity is measured within a 1 cm3 box by transmitting a sound pulse from the center transducer. The instrument measures the Doppler shift introduced by the reflections from particles suspended in the water, which is picked up by the 3 receivers that surround the center transducer. This data product is the eastward component of turbulent seawater velocity relative to true North. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(879,'northward_turbulent_velocity',10,1,NULL,128,7,'Northward Turbulent Point Seawater Velocity','northward_sea_water_velocity',3,54,'{"lat": "CC_lat", "lon": "CC_lon", "u": "PD539", "timestamp": "PD11", "v": "PD540"}','VELPTTU-VLN_L1','Turbulent Point Water Velocity is the measurement of current velocity, which can be used to derive turbulence data. Current velocity is measured within a 1 cm3 box by transmitting a sound pulse from the center transducer. The instrument measures the Doppler shift introduced by the reflections from particles suspended in the water, which is picked up by the 3 receivers that surround the center transducer. This data product is the northward component of turbulent seawater velocity relative to true North. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(880,'upward_turbulent_velocity',10,1,NULL,128,7,'Upward Turbulent Point Seawater Velocity','upward_sea_water_velocity',3,57,'{"w": "PD541"}','VELPTTU-VLU_L1','Turbulent Point Water Velocity is the measurement of current velocity, which can be used to derive turbulence data. Current velocity is measured within a 1 cm3 box by transmitting a sound pulse from the center transducer. The instrument measures the Doppler shift introduced by the reflections from particles suspended in the water, which is picked up by the 3 receivers that surround the center transducer. This data product is the upward component of turbulent seawater velocity. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(881,'calibration_temp',11,1,NULL,91,7,'Calibration Temperature',NULL,NULL,NULL,NULL,NULL,'Average temperature during the calibration',NULL,NULL);
INSERT INTO "parameter" VALUES(891,'seafloor_pressure',10,1,NULL,80,7,'Seafloor Pressure','sea_water_pressure_at_sea_floor',4,6,'{"p_psia": "PD94"}','SFLPRES_L1','Seafloor Pressure is a measurement of the force on the seafloor exerted by the weight of the overlying seawater column plus the weight of the atmosphere (hydrostatic plus atmospheric). Units: dbar',3,1);
INSERT INTO "parameter" VALUES(902,'eastward_beam_seawater_velocity',10,1,NULL,128,7,'Eastward Seawater Velocity','eastward_sea_water_velocity',4,28,'{"vf": "PD617", "h": "PD672", "lon": "CC_lon", "b4": "PD872", "p": "PD673", "r": "PD674", "b1": "PD869", "b2": "PD870", "b3": "PD871", "lat": "CC_lat", "dt": "PD10", "z": "PD671"}','VELPROF-VLE_L1','A Velocity Profile includes water velocity (speed & direction) throughout the depth range of an ADCP sensor. This instance is the eastward seawater velocity component with magnetic variation accounted for. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(903,'northward_beam_seawater_velocity',10,1,NULL,128,7,'Northward Seawater Velocity','northward_sea_water_velocity',4,29,'{"vf": "PD617", "h": "PD672", "lon": "CC_lon", "b4": "PD872", "p": "PD673", "r": "PD674", "b1": "PD869", "b2": "PD870", "b3": "PD871", "lat": "CC_lat", "dt": "PD10", "z": "PD671"}','VELPROF-VLN_L1','A Velocity Profile includes water velocity (speed & direction) throughout the depth range of an ADCP sensor. This instance is the northward seawater velocity component with magnetic variation accounted for. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(904,'upward_seawater_velocity',10,1,NULL,128,7,'Upward Seawater Velocity','upward_sea_water_velocity',4,30,'{"vf": "PD617", "h": "PD672", "b4": "PD872", "p": "PD673", "r": "PD674", "b1": "PD869", "b2": "PD870", "b3": "PD871"}','VELPROF-VLU_L1','A Velocity Profile includes water velocity (speed & direction) throughout the depth range of an ADCP sensor. This instance is the upward seawater velocity component. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(905,'beam_error_velocity',10,1,NULL,128,7,'Error Seawater Velocity',NULL,4,31,'{"b4": "PD872", "b1": "PD869", "b2": "PD870", "b3": "PD871"}','VELPROF-EVL_L1','A Velocity Profile includes water velocity (speed & direction) throughout the depth range of an ADCP sensor. This instance is the error seawater velocity component. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(908,'seawater_temperature',10,1,NULL,91,7,'Seawater Temperature','sea_water_temperature',4,35,'{"a1": "CC_a1", "a0": "CC_a0", "a3": "CC_a3", "a2": "CC_a2", "t0": "PD193"}','TEMPWAT_L1','Seawater temperature near the sensor. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(909,'seawater_pressure',10,1,NULL,80,7,'Seawater Pressure','sea_water_pressure',3,36,'{"pa0": "CC_pa0", "ptca1": "CC_ptca1", "p0": "PD195", "pa1": "CC_pa1", "pa2": "CC_pa2", "t0": "PD196", "ptempa2": "CC_ptempa2", "ptca0": "CC_ptca0", "ptempa0": "CC_ptempa0", "ptempa1": "CC_ptempa1", "offset": "CC_offset", "ptcb0": "CC_ptcb0", "ptcb1": "CC_ptcb1", "ptcb2": "CC_ptcb2", "ptca2": "CC_ptca2"}','PRESWAT_L1','Seawater Pressure refers to the pressure exerted on a sensor in situ by the weight of the column of seawater above it. It is calculated by subtracting one standard atmosphere from the absolute pressure at the sensor to remove the weight of the atmosphere on top of the water column. The pressure at a sensor in situ provides a metric of the depth of that sensor. Units: dbar',3,1);
INSERT INTO "parameter" VALUES(910,'seawater_conductivity',10,1,NULL,36,7,'Seawater Conductivity','sea_water_electrical_conductivity',6,37,'{"p1": "PD909", "g": "CC_g", "i": "CC_i", "h": "CC_h", "j": "CC_j", "ctcor": "CC_ctcor", "t1": "PD908", "cpcor": "CC_cpcor", "c0": "PD194"}','CONDWAT_L1','Seawater conductivity refers to the ability of seawater to conduct electricity. The presence of ions in the seawater, such as salt, increases the electrical conducting ability of seawater. As such, conductivity can be used as a proxy for determining the quantity of salt in a sample of seawater. Units: S m-1',3,1);
INSERT INTO "parameter" VALUES(925,'cycle_rate',11,12,NULL,199,10,'Cycle Rate',NULL,0,NULL,NULL,NULL,'Cycle rate, computed by device',NULL,NULL);
INSERT INTO "parameter" VALUES(926,'absorbance_ratio_434',10,1,NULL,66,7,'Optical Absorbance Ratio at 434 Nm',NULL,0,39,'{"light": "PD357"}','CO2ABS1-SAMP_L0','The Optical Absorbance ratio at 434 nm collected during the measurement cycle and used to calculate the PCO2WAT data product.',4,0);
INSERT INTO "parameter" VALUES(927,'absorbance_ratio_620',10,1,NULL,66,7,'Optical Absorbance Ratio at 620 Nm',NULL,0,40,'{"light": "PD357"}','CO2ABS2-SAMP_L0','The Optical Absorbance ratio at 620 nm collected during the measurement cycle and used to calculate the PCO2WAT data product.',4,0);
INSERT INTO "parameter" VALUES(928,'absorbance_blank_434',10,1,NULL,8,7,'Optical Absorbance Ratio at 434 Nm - Blank',NULL,4,39,'{"light": "PD2712"}','CO2ABS1-BLNK_L0','The Optical Absorbance ratio at 434 nm collected during the blank cycle and used to calculate the PCO2WAT data product.',4,0);
INSERT INTO "parameter" VALUES(929,'absorbance_blank_620',10,1,NULL,8,7,'Optical Absorbance Ratio at 620 Nm - Blank',NULL,4,40,'{"light": "PD2712"}','CO2ABS2-BLNK_L0','The Optical Absorbance ratio at 620 nm collected during the blank cycle and used to calculate the PCO2WAT data product.',4,0);
INSERT INTO "parameter" VALUES(930,'pco2w_thermistor_temperature',10,1,NULL,91,7,'Thermistor Temperature',NULL,4,43,'{"traw": "PD359"}','CO2THRM_L1','This is the Thermistor Temperature measurement, used to calculate the L1 PCO2WAT Partial Pressure of CO2 in Seawater data product. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(931,'pco2_seawater',10,1,NULL,217,7,'pCO2 Seawater',NULL,4,44,'{"a434blank": "dpi_CO2ABS1-BLNK_L0", "therm": "PD359", "ea620": "CC_ea620", "light": "PD357", "ea434": "CC_ea434", "calt": "CC_calt", "eb434": "CC_eb434", "mtype": "PD355", "a620blank": "dpi_CO2ABS2-BLNK_L0", "eb620": "CC_eb620", "cala": "CC_cala", "calb": "CC_calb", "calc": "CC_calc"}','PCO2WAT_L1','Partial Pressure of CO2 in Seawater provides a measure of the amount of CO2 and HCO3 in seawater. Specifically, it refers to the pressure that would be exerted by CO2 if all other gases were removed. Partial pressure of a gas dissolved in seawater is understood as the partial pressure in air that the gas would exert in a hypothetical air volume in equilibrium with that seawater. Units: uatm',3,1);
INSERT INTO "parameter" VALUES(932,'thermistor_start',11,3,NULL,66,5,'Thermistor Resistivity at Start of Measurement',NULL,0,NULL,NULL,NULL,'Starting thermistor value',NULL,NULL);
INSERT INTO "parameter" VALUES(933,'reference_light_measurements',3,3,NULL,66,5,'Array of Reference Light Measurements',NULL,0,NULL,NULL,NULL,'Array of reference light measurements',NULL,NULL);
INSERT INTO "parameter" VALUES(935,'thermistor_end',11,3,NULL,66,5,'Thermistor Resistivity at End of Measurement',NULL,0,NULL,NULL,NULL,'Thermistor resistivity with a DC volt range of 0 to 5',NULL,NULL);
INSERT INTO "parameter" VALUES(936,'signal_intensity_434',10,1,NULL,66,7,'Optical Absorbance Signal Intensity at 434 nm',NULL,0,45,'{"light": "PD2708"}','PH434SI_L0','Signal intensity at 434nm ranging from 0 to 4096 (corresponds to a direct current volt range of 0 to 5)',4,0);
INSERT INTO "parameter" VALUES(937,'signal_intensity_578',10,1,NULL,66,7,'Optical Absorbance Signal Intensity at 578 Nm',NULL,0,46,'{"light": "PD2708"}','PH578SI_L0','Signal intensity at 578nm ranging from 0 to 4096 (corresponds to a direct current volt range of 0 to 5)',4,0);
INSERT INTO "parameter" VALUES(938,'phsen_thermistor_temperature',10,1,NULL,38,7,'Thermistor Temperature at End of Measurement',NULL,4,47,'{"traw": "PD935"}','ABSTHRM_L1','Thermistor Temperature refers to the internal instrument temperature of the pH sensor, as measured by the thermistor (in volts). It is used to determine salinity and temperature dependent molar absorptivities in the seawater sample in order to make an accurate pH estimation. Units: Volts',3,1);
INSERT INTO "parameter" VALUES(939,'ph_seawater',10,1,NULL,8,7,'pH of Seawater','sea_water_ph_reported_on_total_scale',4,48,'{"ind_slp": "CC_ind_slp", "therm": "PD938", "light": "PD2708", "ea434": "CC_ea434", "eb434": "CC_eb434", "psal": "dpi_PRACSAL_L2", "ea578": "CC_ea578", "ind_off": "CC_ind_off", "ref": "PD933", "eb578": "CC_eb578"}','PHWATER_L1','pH is a measurement of the concentration of hydrogen ions in a solution. pH ranges from acidic to basic on a scale from 0 to 14 with 7 being neutral. Units: pH units',3,1);
INSERT INTO "parameter" VALUES(940,'estimated_oxygen_concentration',11,1,NULL,220,7,'DO',NULL,3,NULL,NULL,'DOCONCS_L1','Dissolved Oxygen (DO) Concentration from the Stable Response Dissolved Oxygen Instrument is a measure of the concentration of gaseous oxygen mixed in seawater. This instrument measures dissolved oxygen concentrations on mobile assets, deep profilers, and moorings. This data product is corrected for temperature from a collocated CTD. Units: umol L-1.',3,1);
INSERT INTO "parameter" VALUES(941,'estimated_oxygen_saturation',11,1,NULL,187,7,'Dissolved Oxygen Saturation',NULL,3,NULL,NULL,NULL,'Oxygen saturation is the percentage of dissolved oxygen relative to the absolute solubility of oxygen at a particular water temperature.',NULL,NULL);
INSERT INTO "parameter" VALUES(942,'optode_temperature',11,1,NULL,91,7,'Optode Temperature',NULL,3,NULL,NULL,NULL,'Oxygen sensor ambient temperature',NULL,NULL);
INSERT INTO "parameter" VALUES(943,'calibrated_phase',11,1,NULL,98,7,'Calibrated Phase Difference',NULL,3,NULL,NULL,'DOCONCS-DEG_L0','Calibrated phase difference, used to calculate temperature compensated oxygen concentration.',4,0);
INSERT INTO "parameter" VALUES(944,'temp_compensated_phase',11,1,NULL,98,7,'Temperature Compensated Phase',NULL,3,NULL,NULL,NULL,'Temerature compensated phase.',NULL,NULL);
INSERT INTO "parameter" VALUES(945,'blue_phase',11,1,NULL,98,7,'Blue Light Phase',NULL,3,NULL,NULL,NULL,'Phase measurement with blue excitation.',NULL,NULL);
INSERT INTO "parameter" VALUES(946,'red_phase',11,1,NULL,98,7,'Red Light Phase',NULL,3,NULL,NULL,NULL,'Phase measurement with red excitation.',NULL,NULL);
INSERT INTO "parameter" VALUES(947,'blue_amplitude',11,1,NULL,150,7,'Blue Light Amplitude',NULL,1,NULL,NULL,NULL,'Amplitude measurement with blue excitation.',NULL,NULL);
INSERT INTO "parameter" VALUES(948,'red_amplitude',11,1,NULL,150,7,'Red Light Amplitude',NULL,1,NULL,NULL,NULL,'Amplitude measurement with red excitation.',NULL,NULL);
INSERT INTO "parameter" VALUES(949,'raw_temperature',11,1,NULL,150,7,'Thermistor Voltage',NULL,1,NULL,NULL,NULL,'Raw temperature, voltage from thermistor.',NULL,NULL);
INSERT INTO "parameter" VALUES(960,'upward_earth_seawater_velocity',10,1,NULL,128,7,'Upward Seawater Velocity','upward_sea_water_velocity',4,128,'{"w": "PD716"}','VELPROF-VLU_L1','A Velocity Profile includes water velocity (speed & direction) throughout the depth range of an ADCP sensor. This instance is the upward seawater velocity component. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(961,'earth_error_velocity',10,1,NULL,128,7,'Error Velocity',NULL,4,129,'{"e": "PD717"}','VELPROF-ERR_L1','A Velocity Profile includes water velocity (speed & direction) throughout the depth range of an ADCP sensor. This instance is the error component. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(964,'ctd_tc_oxygen',10,1,NULL,220,7,'DO',NULL,4,60,'{"o2_counts": "PD197"}','DOCONCS_L1','Dissolved Oxygen (DO) Concentration from the Stable Response Dissolved Oxygen Instrument is a measure of the concentration of gaseous oxygen mixed in seawater. Units: umol L-1.',3,1);
INSERT INTO "parameter" VALUES(965,'vent_fluid_temperaure',10,1,NULL,91,7,'Vent Fluid Absolute Temperature',NULL,4,63,'{"ts_slope": "CC_ts_slope", "tc_slope": "CC_tc_slope", "V_tc": "PD430", "V_ts": "PD428"}','TRHPHTE-ABS_L1','Vent Fluid Absolute Temperature refers to temperature calculated from the Temperature-Resistivity Probe Instrument (TRHPH) Thermistor and Thermocouple. It is calculated using response curves from Thermocouple and Thermistor Temperature (in volts) that are adjusted to the custom instrument design and corrected by laboratory calibration. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(966,'vent_fluid_chloride_conc',10,1,NULL,179,7,'Vent Fluid Chloride Concentration',NULL,4,64,'{"V_R3": "PD423", "V_R2": "PD422", "V_R1": "PD421", "T": "PD965"}','TRHPHCC_L2','Vent Fluid Chloride Concentration (Cl-) is calculated using resistivity and temperature measured by a Hydrothermal Vent Fluid Temperature and Resistivity sensor placed in a high-temperature hydrothermal vent. Units: mmol kg-1',3,2);
INSERT INTO "parameter" VALUES(967,'vent_fluid_orp',10,1,NULL,150,7,'Vent Fluid Oxidation-Reduction Potential',NULL,4,65,'{"offset": "CC_offset", "gain": "CC_gain", "V": "PD427"}','TRHPHEH_L1','Vent Fluid Oxidation-Reduction Potential (ORP) is a measure of the tendency of a vent fluid, and the chemical species within it, to acquire electrons (i.e. be reduced). The more positive the potential, the greater the affinity for electrons and tendency to be reduced. Units: mV',3,1);
INSERT INTO "parameter" VALUES(969,'velocity_offset_a',11,4,NULL,66,7,'Beam-A Velocity Offset',NULL,0,NULL,NULL,NULL,'Calibrated velocity offset for acoustic beam A in 2s complement Hexidecimal',NULL,NULL);
INSERT INTO "parameter" VALUES(970,'velocity_offset_b',11,4,NULL,66,7,'Beam-B Velocity Offset',NULL,0,NULL,NULL,NULL,'Calibrated velocity offset for acoustic beam B in 2s complement Hexidecimal',NULL,NULL);
INSERT INTO "parameter" VALUES(971,'velocity_offset_c',11,4,NULL,66,7,'Beam-C Velocity Offset',NULL,0,NULL,NULL,NULL,'Calibrated velocity offset for acoustic beam C in 2s complement Hexidecimal',NULL,NULL);
INSERT INTO "parameter" VALUES(972,'velocity_offset_d',11,4,NULL,66,7,'Beam-D Velocity Offset',NULL,0,NULL,NULL,NULL,'Calibrated velocity offset for acoustic beam D in 2s complement Hexidecimal',NULL,NULL);
INSERT INTO "parameter" VALUES(973,'compass_offset_0',11,4,NULL,8,7,'Compass Offset 0',NULL,0,NULL,NULL,NULL,'Calibrated compass offset 0',NULL,NULL);
INSERT INTO "parameter" VALUES(974,'compass_offset_1',11,4,NULL,8,7,'Compass Offset 1',NULL,0,NULL,NULL,NULL,'Calibrated compass offset 1',NULL,NULL);
INSERT INTO "parameter" VALUES(975,'compass_offset_2',11,4,NULL,8,7,'Compass Offset 2',NULL,0,NULL,NULL,NULL,'Calibrated compass offset 2',NULL,NULL);
