INSERT INTO "parameter" VALUES(1002,'partial_pressure_co2_atm',10,1,NULL,217,7,'pCO2 Atmosphere',NULL,3,67,'{"p": "PD999", "xCO2": "PD994"}','PCO2ATM_L1','Partial Pressure of CO2 in Atmosphere refers to the pressure that would be exerted by CO2 if all other gases in the atmosphere were removed. pCO2 in the air is determined optically by measuring the absorbance by CO2 in the infrared range. Units: uatm',3,1);
INSERT INTO "parameter" VALUES(1003,'partial_pressure_co2_ssw',10,1,NULL,217,7,'pCO2 Surface Seawater',NULL,3,67,'{"p": "PD999", "xCO2": "PD995"}','PCO2SSW_L1','Partial Pressure of CO2 in Surface Seawater refers to the pressure that would be exerted by CO2 if all other gases were removed. Partial pressure of a gas dissolved in seawater is understood as the partial pressure in air that the gas would exert in a hypothetical air volume in equilibrium with that seawater. pCO2 in surface seawater is determined optically by measuring the infrared absorbance level of CO2. Units: uatm',3,1);
