INSERT INTO "parameter" VALUES(1048,'temperature1',11,1,NULL,91,7,'Vent Fluid Temperature 01',NULL,2,NULL,NULL,'TEMPVNT_L1','Vent Fluid Temperature is measured continuously at the sample inlet of the Hydrothermal Vent Fluid Interactive Sampler (RASFL) instrument. This data product includes temperature measurements made by resistance platinum detectors at three locations: two in a low temperature vent and one at a nearby high temperature vent. Locations of the detectors can be found in the metadata. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(1049,'temperature2',11,1,NULL,91,7,'Vent Fluid Temperature 02',NULL,2,NULL,NULL,'TEMPVNT_L1','Vent Fluid Temperature is measured continuously at the sample inlet of the Hydrothermal Vent Fluid Interactive Sampler (RASFL) instrument. This data product includes temperature measurements made by resistance platinum detectors at three locations: two in a low temperature vent and one at a nearby high temperature vent. Locations of the detectors can be found in the metadata. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(1050,'temperature3',11,1,NULL,91,7,'Vent Fluid Temperature 03',NULL,2,NULL,NULL,'TEMPVNT_L1','Vent Fluid Temperature is measured continuously at the sample inlet of the Hydrothermal Vent Fluid Interactive Sampler (RASFL) instrument. This data product includes temperature measurements made by resistance platinum detectors at three locations: two in a low temperature vent and one at a nearby high temperature vent. Locations of the detectors can be found in the metadata. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(1051,'barometric_pressure',11,1,NULL,155,7,'Barometric Pressure',NULL,2,NULL,NULL,'BARPRES_L0','Barometric Pressure is a measure of the weight of the column of air above the sensor. It is also commonly referred to as atmospheric pressure. Units: mbar',4,0);
