INSERT INTO "parameter" VALUES(1085,'vel3d_c_eastward_turbulent_velocity',10,1,NULL,128,7,'Eastward Turbulent Point Seawater Velocity','eastward_sea_water_velocity',3,55,'{"lat": "CC_lat", "lon": "CC_lon", "u": "PD551", "timestamp": "PD11", "v": "PD552"}','VELPTTU-VLE_L1','Turbulent Point Water Velocity is the measurement of current velocity, which can be used to derive turbulence data. Current velocity is measured within a 1 cm3 box by transmitting a sound pulse from the center transducer. The instrument measures the Doppler shift introduced by the reflections from particles suspended in the water, which is picked up by the 3 receivers that surround the center transducer. This data product is the eastward component of turbulent seawater velocity relative to true North. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(1086,'vel3d_c_northward_turbulent_velocity',10,1,NULL,128,7,'Northward Turbulent Point Seawater Velocity','northward_sea_water_velocity',3,56,'{"lat": "CC_lat", "lon": "CC_lon", "u": "PD551", "timestamp": "PD11", "v": "PD552"}','VELPTTU-VLN_L1','Turbulent Point Water Velocity is the measurement of current velocity, which can be used to derive turbulence data. Current velocity is measured within a 1 cm3 box by transmitting a sound pulse from the center transducer. The instrument measures the Doppler shift introduced by the reflections from particles suspended in the water, which is picked up by the 3 receivers that surround the center transducer. This data product is the northward component of turbulent seawater velocity relative to true North. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(1087,'vel3d_c_upward_turbulent_velocity',10,1,NULL,128,7,'Upward Turbulent Point Seawater Velocity','upward_sea_water_velocity',3,58,'{"w": "PD553"}','VELPTTU-VLU_L1','Turbulent Point Water Velocity is the measurement of current velocity, which can be used to derive turbulence data. Current velocity is measured within a 1 cm3 box by transmitting a sound pulse from the center transducer. The instrument measures the Doppler shift introduced by the reflections from particles suspended in the water, which is picked up by the 3 receivers that surround the center transducer. This data product is the upward component of turbulent seawater velocity. Units: m s-1',3,1);
