INSERT INTO "parameter" VALUES(1154,'eastward_velocity',10,1,NULL,128,7,'Eastward Mean Point Seawater Velocity','eastward_sea_water_velocity',NULL,106,'{"lat": "CC_lat", "lon": "CC_lon", "u": "PD441", "timestamp": "PD7", "v": "PD442"}','VELPTMN-VLE_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the eastward component of mean point seawater velocity in earth coordinates relative to true north (accounted for magnetic variation). Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(1155,'northward_velocity',10,1,NULL,128,7,'Northward Mean Point Seawater Velocity','northward_sea_water_velocity',NULL,105,'{"lat": "CC_lat", "lon": "CC_lon", "u": "PD441", "timestamp": "PD7", "v": "PD442"}','VELPTMN-VLN_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the northward component of mean point seawater velocity in earth coordinates relative to true north (accounted for magnetic variation). Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(1156,'upward_velocity',10,1,NULL,128,7,'Upward Mean Point Seawater Velocity','upward_sea_water_velocity',NULL,107,'{"w": "PD443"}','VELPTMN-VLU_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the upward component of mean point seawater velocity. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(1157,'ensemble_start_time_2',11,2,NULL,204,7,'Ensemble Start Time, UTC',NULL,6,NULL,NULL,NULL,'Ensemble start time in seconds since Jan 01, 1900.',NULL,NULL);
INSERT INTO "parameter" VALUES(1158,'real_time_clock_2',3,3,NULL,8,5,'Real Time Clock Array',NULL,0,NULL,NULL,NULL,'Elements of the real-time clock array are: Year, Month, Day, Hour, Minute, Seconds, Hundredths. Units are standard time units, applied to each element respectively (year, month, day, hour, minutes, seconds, cseconds).',NULL,NULL);
INSERT INTO "parameter" VALUES(1160,'bt_pings_per_ensemble',11,9,NULL,8,10,'BT Pings Per Ensemble',NULL,0,NULL,NULL,NULL,'Stores the number of bottom-track pings to average together in each ensemble (BP-command). If BP = 0, the ADCP does not collect bottom-track data. The ADCP automatically ex-tends the ensemble interval (TE) if BP x TP > TE. Scaling: LSD = 1 ping; Range = 0 to 999 pings',NULL,NULL);
INSERT INTO "parameter" VALUES(1161,'bt_delay_before_reacquire',11,9,NULL,8,10,'BT Delay Before Reacquire',NULL,0,NULL,NULL,NULL,'Stores the number of ADCP ensembles to wait after losing the bottom before trying to reacquire it (BD-command). Scaling: LSD = 1 ensemble; Range = 0 to 999 ensembles',NULL,NULL);
INSERT INTO "parameter" VALUES(1162,'bt_corr_magnitude_min',11,12,NULL,66,10,'BT Minimum Correlation Magnitude',NULL,0,NULL,NULL,NULL,'Stores the minimum correlation magnitude value (BC-command). Scaling: LSD = 1 count; Range = 0 to 255 counts',NULL,NULL);
INSERT INTO "parameter" VALUES(1163,'bt_eval_magnitude_min',11,12,NULL,66,10,'BT Minimum Evaluation Amplitude',NULL,0,NULL,NULL,NULL,'Stores the minimum evaluation amplitude value (BA-command). Scaling: LSD = 1 count; Range = 1 to 255 counts',NULL,NULL);
INSERT INTO "parameter" VALUES(1164,'bt_percent_good_min',11,12,NULL,187,10,'BT Minimum Percent Good, Percent',NULL,0,NULL,NULL,NULL,'Stores the minimum percentage of bottom-track pings in an ensemble that must be good to output velocity data (BG-command).',NULL,NULL);
INSERT INTO "parameter" VALUES(1165,'bt_mode',11,12,NULL,8,10,'BT Mode',NULL,0,NULL,NULL,NULL,'Stores the bottom-tracking mode (BM-command). When the Lowered ADCP mode is set (WM15) the Bottom-Track mode will show up as Mode 11 (BM11). When the system uses standard Bottom-Track (BT-RA, see OL command), the Bottom-Track mode will show up as Mode 50 (BM50).',NULL,NULL);
INSERT INTO "parameter" VALUES(1166,'bt_error_velocity_max',11,9,NULL,176,10,'BT Maximum Error Velocity',NULL,0,NULL,NULL,NULL,'Stores the error velocity maximum value (BE-command). Scaling: LSD = 1 mm/s; Range = 0 to 5000 mm/s (0 = did not screen data)',NULL,NULL);
INSERT INTO "parameter" VALUES(1167,'bt_beam1_range',11,10,NULL,59,10,'BT Beam 1 Range',NULL,0,NULL,NULL,NULL,'Contains the two lower bytes of the vertical range from the ADCP to the sea bottom (or surface) as determined by each beam. This vertical range does not consider the effects of pitch and roll. When bottom detections are bad, BT Range = 0. Scaling: LSD = 1 cm; Range = 0 to 65535 cm.',NULL,NULL);
INSERT INTO "parameter" VALUES(1168,'bt_beam2_range',11,10,NULL,59,10,'BT Beam 2 Range',NULL,0,NULL,NULL,NULL,'Contains the two lower bytes of the vertical range from the ADCP to the sea bottom (or surface) as determined by each beam. This vertical range does not consider the effects of pitch and roll. When bottom detections are bad, BT Range = 0. Scaling: LSD = 1 cm; Range = 0 to 65535 cm.',NULL,NULL);
INSERT INTO "parameter" VALUES(1169,'bt_beam3_range',11,10,NULL,59,10,'BT Beam 3 Range',NULL,0,NULL,NULL,NULL,'Contains the two lower bytes of the vertical range from the ADCP to the sea bottom (or surface) as determined by each beam. This vertical range does not consider the effects of pitch and roll. When bottom detections are bad, BT Range = 0. Scaling: LSD = 1 cm; Range = 0 to 65535 cm.',NULL,NULL);
