INSERT INTO "parameter" VALUES(1179,'bt_beam1_eval_amp',11,12,NULL,66,10,'BT Bottom Beam 1 Evaluation Amplitude',NULL,0,NULL,NULL,NULL,'Contains the evaluation amplitude of the matching filter used in determining the strength of the bottom echo. Scaling: LSD = 1 count; Range = 0 to 255 counts',NULL,NULL);
