INSERT INTO "parameter" VALUES(1482,'sci_flbbcd_cdom_units',11,1,NULL,189,NULL,'CDOM Concentration',NULL,4,NULL,NULL,'CDOMFLO_L1','Fluorometric CDOM Concentration is a measure of how much light has been re-emitted (fluoresced) from colored organic compounds found in the colored dissolved organic matter (CDOM) in seawater. Examples of CDOM include tannins (polyphenols that bind to proteins and other large molecules) or lignins (polymers of phenolic acids) from decaying plant material and byproducts from the decomposition of animals. It accounts for the tea-like color in seawater. CDOM is not particulate, but seawater can contain both CDOM and turbidity. Units: ppb',3,1);
INSERT INTO "parameter" VALUES(1483,'sci_flbbcd_chlor_ref',11,1,NULL,8,NULL,'FLBBCD Chlorophyll Ref',NULL,4,NULL,NULL,NULL,NULL,NULL,NULL);
