INSERT INTO "parameter" VALUES(1485,'sci_flbbcd_chlor_units',11,1,NULL,218,NULL,'Chlorophyll-a Concentration','mass_concentration_of_chlorophyll_a_in_sea_water',4,NULL,NULL,'CHLAFLO_L1','Fluorometric Chlorophyll-a Concentration is an estimate of phytoplankton biomass using fluorescence. The fluorometer emits light at a specific wavelength that is absorbed by chlorophyll and re-emitted as light at a different wavelength. By measuring the intensity of the re-emitted wavelength of light the chlorophyll-a concentration in the surrounding seawater can be estimated. Chlorophyll-a concentrations can be used as a proxy for phytoplankton biomass as it is a dominant photosynthetic pigment. Units: ug L-1',3,1);
