INSERT INTO "parameter" VALUES(1552,'conductivity',11,1,NULL,149,7,'Seawater Conductivity Measurement','sea_water_electrical_conductivity',4,NULL,NULL,NULL,'Seawater conductivity refers to the ability of seawater to conduct electricity. The presence of ions in the seawater, such as salt, increases the electrical conducting ability of seawater. As such, conductivity can be used as a proxy for determining the quantity of salt in a sample of seawater. This is the unprocessed data in mS cm-1 that are output directly from the sensor which are then converted to salinity in S m-1. Units: mS cm-1',NULL,NULL);
