INSERT INTO "parameter" VALUES(1959,'ctdpf_ckl_seawater_pressure',10,1,NULL,80,5,'Seawater Pressure','sea_water_pressure',NULL,86,'{"p0": "PD195"}','PRESWAT_L1','Seawater Pressure refers to the pressure exerted on a sensor in situ by the weight of the column of seawater above it. It is calculated by subtracting one standard atmosphere from the absolute pressure at the sensor to remove the weight of the atmosphere on top of the water column. The pressure at a sensor in situ provides a metric of the depth of that sensor. Units: dbar',3,1);
INSERT INTO "parameter" VALUES(1960,'ctdpf_ckl_seawater_temperature',10,1,NULL,91,7,'Seawater Temperature','sea_water_temperature',4,85,'{"t0": "PD193"}','TEMPWAT_L1','Seawater temperature near the sensor. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(1961,'ctdpf_ckl_seawater_conductivity',10,1,NULL,36,7,'Seawater Conductivity','sea_water_conductivity',4,84,'{"c0": "PD194"}','CONDWAT_L1','Seawater conductivity refers to the ability of seawater to conduct electricity. The presence of ions in the seawater, such as salt, increases the electrical conducting ability of seawater. As such, conductivity can be used as a proxy for determining the quantity of salt in a sample of seawater. Units: S m-1',3,1);
INSERT INTO "parameter" VALUES(1964,'dofst_k_oxygen',11,10,NULL,22,10,'DO Measurement',NULL,0,NULL,NULL,'DOCONCF_L0','Dissolved Oxygen (DO) unprocessed measurement from the Fast Response (Fastrep) Dissolved Oxygen Instrument. Units: Hz',NULL,NULL);
INSERT INTO "parameter" VALUES(1965,'dofst_k_oxygen_l2',10,1,NULL,221,7,'DO - Pressure Temp Sal Corrected (CTD)','moles_of_oxygen_per_unit_mass_in_sea_water',4,88,'{"A": "CC_residual_temperature_correction_factor_a", "Soc": "CC_oxygen_signal_slope", "B": "CC_residual_temperature_correction_factor_b", "E": "CC_residual_temperature_correction_factor_e", "SP": "dpi_PRACSAL_L2", "lon": "CC_longitude", "C": "CC_residual_temperature_correction_factor_c", "Foffset": "CC_frequency_offset", "P": "PD1959", "frequency": "PD1964", "T": "PD1960", "lat": "CC_latitude"}','DOCONCF_L2','Dissolved Oxygen (DO) Concentration from the Fast Response (Fastrep) Dissolved Oxygen Instrument is a measure of the concentration of gaseous oxygen mixed in seawater. This instrument measures dissolved oxygen concentrations on shallow coastal profilers through rapid oxygen gradients.This data product is corrected for salinity- temperature- and depth from a collocated CTD. Units: umol kg-1.',3,2);
