INSERT INTO "parameter" VALUES(2581,'hpies_pressure',11,10,NULL,5,10,'Seafloor Pressure',NULL,NULL,NULL,NULL,'IESPRES_L0','Seafloor Pressure is a measurement of the force on the seafloor exerted by the weight of the overlying seawater column plus the weight of the atmosphere (hydrostatic plus atmospheric). This specific instance is the Level 0 unprocessed data product. Units: 0.001 dbar',4,0);
