INSERT INTO "parameter" VALUES(2610,'velocity_beam3_m_s',11,1,NULL,128,7,'Velocity Beam3 or Z or Up Coordinates',NULL,4,NULL,NULL,NULL,'velocity beam3 or Z or Up coordinates (m/s)',NULL,NULL);
