INSERT INTO "parameter" VALUES(2615,'ctd_psu',11,1,NULL,8,7,'Practical Salinity','sea_water_practical_salinity',3,NULL,NULL,NULL,'Salinity is generally defined as the concentration of dissolved salt in a parcel of seawater. Practical Salinity is a more specific unitless quantity calculated from the conductivity of seawater and adjusted for temperature and pressure. It is approximately equivalent to Absolute Salinity (the mass fraction of dissolved salt in seawater) but they are not interchangeable. Units: unitless',NULL,NULL);
INSERT INTO "parameter" VALUES(2616,'ctd_temp',11,1,NULL,91,7,'Seawater Temperature','sea_water_temperature',4,NULL,NULL,NULL,'Seawater temperature near the sensor. Units: degrees Celsius',NULL,NULL);
INSERT INTO "parameter" VALUES(2617,'ctd_dbar',11,1,NULL,80,7,'Seawater Pressure','sea_water_pressure',3,NULL,NULL,NULL,'Seawater Pressure refers to the pressure exerted on a sensor in situ by the weight of the column of seawater above it. It is calculated by subtracting one standard atmosphere from the absolute pressure at the sensor to remove the weight of the atmosphere on top of the water column. The pressure at a sensor in situ provides a metric of the depth of that sensor. Units: dbar',NULL,NULL);
INSERT INTO "parameter" VALUES(2622,'suspect_timestamp',5,6,NULL,8,4,'Suspect Timestamp',NULL,0,NULL,NULL,NULL,'Flag indicating a potential inaccuracy in the timestamp. No - 0, Yes - 1',NULL,NULL);
INSERT INTO "parameter" VALUES(2623,'trhph_thermistor_temp',10,1,NULL,91,7,'Thermistor Reference Temperature',NULL,0,108,'{"V_ts": "PD428"}','TRHPHTE_REF_L1','Thermistor Reference Temperature from TRHPH is an intermediate data product that is important for monitoring and troubleshooting the instrument. It is engineering data that should not be confused with scientific data as it does not represent a scientifically meaningful environmental temperature. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(2624,'thsph_temp_th',10,1,NULL,91,7,'Vent Fluid Absolute Temperature - High',NULL,2,99,'{"tc_rawdec_H": "PD2264", "e2l_H": "CC_e2l_H", "l2s_H": "CC_l2s_H", "ts_rawdec_r": "PD2266", "l2s_r": "CC_l2s_r", "s2v_r": "CC_s2v_r", "e2l_r": "CC_e2l_r"}','THSPHTE-TH_L1','The Vent Fluid Absolute Temperature is the calibrated sum of the Thermocouple temperature and the Reference Thermistor temperature. This data product is a measurement of the high temperature fluid near the vent. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(2625,'thsph_temp_tl',10,1,NULL,91,7,'Vent Fluid Absolute Temperature - Low',NULL,2,100,'{"tc_rawdec_L": "PD2265", "e2l_L": "CC_e2l_L", "ts_rawdec_r": "PD2266", "l2s_L": "CC_l2s_L", "l2s_r": "CC_l2s_r", "s2v_r": "CC_s2v_r", "e2l_r": "CC_e2l_r"}','THSPHTE-TL_L1','The Vent Fluid Absolute Temperature is the calibrated sum of the Thermocouple temperature and the Reference Thermistor temperature. This data product is a measurement of the low temperature fluid near the vent. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(2626,'thsph_temp_tch',10,1,NULL,91,7,'Vent Fluid Thermocouple Temperature - High',NULL,2,101,'{"l2s_H": "CC_l2s_H", "tc_rawdec_H": "PD2264", "e2l_H": "CC_e2l_H"}','THSPHTE-TCH_L1','Vent Fluid Temperature is measured at the sample inlet of the Hydrothermal Vent Fluid In-situ Chemistry (THSPH) instrument. There are temperature measurements at two locations: one in high temperature vent fluid and one in low temperature fluid near the vent. This data product is the thermocouple temperature measurement of the high temperature vent fluid. Exact locations can be found in the metadata. Units: degrees Celsius',NULL,1);
INSERT INTO "parameter" VALUES(2627,'thsph_temp_tcl',10,1,NULL,91,7,'Vent Fluid Thermocouple Temperature - Low',NULL,2,102,'{"tc_rawdec_L": "PD2265", "e2l_L": "CC_e2l_L", "l2s_L": "CC_l2s_L"}','THSPHTE-TCL_L1','Vent Fluid Temperature is measured at the sample inlet of the Hydrothermal Vent Fluid In-situ Chemistry (THSPH) instrument. There are temperature measurements at two locations: one in high temperature vent fluid and one in low temperature fluid near the vent. This data product is the thermocouple temperature measurement of the low temperature fluid near the vent. Exact locations can be found in the metadata. Units: degrees Celsius',NULL,1);
INSERT INTO "parameter" VALUES(2628,'thsph_temp_int',10,1,NULL,91,7,'Internal Board Thermistor Temperature',NULL,2,103,'{"l2s_b": "CC_l2s_b", "ts_rawdec_b": "PD2267", "e2l_b": "CC_e2l_b"}','THSPHTE-INT_L1','Thermistor temperature inside the electronics pressure housing. Units: degrees Celsius',NULL,1);
INSERT INTO "parameter" VALUES(2629,'thsph_temp_ref',10,1,NULL,91,7,'Reference Thermistor Temperature',NULL,2,104,'{"l2s_r": "CC_l2s_r", "ts_rawdec_r": "PD2266", "e2l_r": "CC_e2l_r"}','THSPHTE-REF_L1','Reference Thermistor Temperature at the electrical cold-junction in the sensor wand. Units: degrees Celsius',NULL,1);
INSERT INTO "parameter" VALUES(2630,'thsph_ph',10,1,NULL,8,5,'Vent Fluid pH - Measured Chloride',NULL,0,110,'{"counts_ysz": "PD2260", "e2l_ysz": "CC_e2l_ysz", "counts_agcl": "PD2261", "arr_agcl": "CC_arr_agcl", "arr_tac": "CC_arr_tac", "chl": "PD966", "arr_hgo": "CC_arr_hgo", "arr_tbc3": "CC_arr_tbc3", "arr_tbc2": "CC_arr_tbc2", "arr_tbc1": "CC_arr_tbc1", "e2l_agcl": "CC_e2l_agcl", "temperature": "PD2624"}','THSPHPH-PH_L2','In-situ pH at high temperature location, using measured [Cl-] from TRHPH and a working reference AgCl electrode. Unitless.',3,2);
INSERT INTO "parameter" VALUES(2631,'thsph_ph_acl',10,1,NULL,8,5,'Vent Fluid pH - Assumed Chloride',NULL,0,111,'{"counts_ysz": "PD2260", "e2l_ysz": "CC_e2l_ysz", "counts_agcl": "PD2261", "arr_agcl": "CC_arr_agcl", "arr_tac": "CC_arr_tac", "arr_hgo": "CC_arr_hgo", "arr_tbc3": "CC_arr_tbc3", "arr_tbc2": "CC_arr_tbc2", "arr_tbc1": "CC_arr_tbc1", "e2l_agcl": "CC_e2l_agcl", "temperature": "PD2624"}','THSPHPH-PH-ACL_L2','In-situ pH at high temperature location, using assumed [Cl-] from a physical sample and a working reference AgCl electrode. Unitless.',3,2);
INSERT INTO "parameter" VALUES(2632,'thsph_ph_noref',10,1,NULL,8,5,'Vent Fluid pH - Measured Chloride - No Reference AgCl',NULL,0,112,'{"counts_ysz": "PD2260", "e2l_ysz": "CC_e2l_ysz", "temperature": "PD2624", "arr_tac": "CC_arr_tac", "chl": "PD966", "arr_hgo": "CC_arr_hgo", "arr_agclref": "CC_arr_agclref", "arr_tbc3": "CC_arr_tbc3", "arr_tbc2": "CC_arr_tbc2", "arr_tbc1": "CC_arr_tbc1", "arr_agcl": "CC_arr_agcl"}','THSPHPH-PH-NOREF_L2','In-situ pH at high temperature location, using measured [Cl-] from TRHPH and a derived value for the AgCl electrode. Unitless.',3,2);
INSERT INTO "parameter" VALUES(2633,'thsph_ph_noref_acl',10,1,NULL,8,5,'Vent Fluid pH - Assumed Chloride - No Reference AgCl',NULL,0,113,'{"counts_ysz": "PD2260", "e2l_ysz": "CC_e2l_ysz", "temperature": "PD2624", "arr_tac": "CC_arr_tac", "arr_hgo": "CC_arr_hgo", "arr_agclref": "CC_arr_agclref", "arr_tbc3": "CC_arr_tbc3", "arr_tbc2": "CC_arr_tbc2", "arr_tbc1": "CC_arr_tbc1", "arr_agcl": "CC_arr_agcl"}','THSPHPH-PH-NOREF-ACL_L2','In-situ pH at high temperature location, using an assumed [Cl-] from a physical sample and a derived value for the AgCl electrode. Unitless.',3,2);
INSERT INTO "parameter" VALUES(2634,'thsph_sulfide',10,1,NULL,179,7,'Hydrogen Sulfide Concentration',NULL,4,114,'{"arr_eh2sg": "CC_arr_eh2sg", "counts_hs": "PD2263", "arr_logkfh2g": "CC_arr_logkfh2g", "e2l_ysz": "CC_e2l_ysz", "arr_yh2sg": "CC_arr_yh2sg", "temperature": "PD2624", "counts_ysz": "PD2260", "arr_hgo": "CC_arr_hgo", "e2l_hs": "CC_e2l_hs"}','THSPHHS-H2S_L2',NULL,3,2);
