INSERT INTO "parameter" VALUES(2645,'spkir_downwelling_vector',10,1,NULL,215,7,'Downwelling Spectral Irradiance',NULL,4,95,'{"counts": "PD1093", "scale": "CC_scale", "immersion_factor": "CC_immersion_factor", "offset": "CC_offset"}','SPECTIR_L1','Downwelling Spectral Irradiance is the measure of electromagnetic radiation per unit area received (i.e. incident) by a sensor within the seawater column. Downwelling spectral irradiance is calculated from measurements made across 7 specific- pre-defined wavebands as follows: 1 = 412nm, 2 = 443nm, 3 = 490nm, 4 = 510nm, 5 = 555nm, 6 = 620nm, 7 = 683nm.. Units: uW cm-2 nm-1',3,1);
