INSERT INTO "parameter" VALUES(2653,'vadcp_eastward_seawater_velocity',10,1,NULL,128,7,'Eastward Turbulent Seawater Velocity','eastward_sea_water_velocity',4,121,'{"vf": "PD617", "h": "PD672", "lon": "CC_lon", "b4": "PD872", "p": "PD673", "r": "PD674", "b1": "PD869", "b2": "PD870", "b3": "PD871", "lat": "CC_lat", "dt": "PD10", "z": "PD671"}','VELTURB-VLE_L1','A Velocity Profile includes water velocity (speed & direction) throughout the depth range of an ADCP sensor. This instance is the eastward seawater velocity component with magnetic variation accounted for. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(2654,'vadcp_northward_seawater_velocity',10,1,NULL,128,7,'Northward Turbulent Seawater Velocity','northward_sea_water_velocity',4,122,'{"vf": "PD617", "h": "PD672", "lon": "CC_lon", "b4": "PD872", "p": "PD673", "r": "PD674", "b1": "PD869", "b2": "PD870", "b3": "PD871", "lat": "CC_lat", "dt": "PD10", "z": "PD671"}','VELTURB-VLN_L1','A Velocity Profile includes water velocity (speed & direction) throughout the depth range of an ADCP sensor. This instance is the northward seawater velocity component with magnetic variation accounted for. Units: m s-1',3,1);
