INSERT INTO "parameter" VALUES(2737,'adcps_jln_echo_intensity_beam1',10,1,NULL,71,7,'Echo Intensity Beam 1',NULL,4,89,'{"raw": "PD724", "sfactor": "CC_scale_factor1"}','ECHOINT-B1_L1','Echo intensity is the strength of the returned sound wave pulse transmitted by the ADCP. Echo intensity can be used as an indicator of the amount of sediment or organisms in the water column, as well as of the quality of a velocity measurement. Units: dB',3,1);
INSERT INTO "parameter" VALUES(2738,'adcps_jln_echo_intensity_beam2',10,1,NULL,71,7,'Echo Intensity Beam 2',NULL,4,89,'{"raw": "PD725", "sfactor": "CC_scale_factor2"}','ECHOINT-B2_L1','Echo intensity is the strength of the returned sound wave pulse transmitted by the ADCP. Echo intensity can be used as an indicator of the amount of sediment or organisms in the water column, as well as of the quality of a velocity measurement. Units: dB',3,1);
INSERT INTO "parameter" VALUES(2739,'adcps_jln_echo_intensity_beam3',10,1,NULL,71,7,'Echo Intensity Beam 3',NULL,4,89,'{"raw": "PD726", "sfactor": "CC_scale_factor3"}','ECHOINT-B3_L1','Echo intensity is the strength of the returned sound wave pulse transmitted by the ADCP. Echo intensity can be used as an indicator of the amount of sediment or organisms in the water column, as well as of the quality of a velocity measurement. Units: dB',3,1);
INSERT INTO "parameter" VALUES(2740,'adcps_jln_echo_intensity_beam4',10,1,NULL,71,7,'Echo Intensity Beam 4',NULL,4,89,'{"raw": "PD727", "sfactor": "CC_scale_factor4"}','ECHOINT-B4_L1','Echo intensity is the strength of the returned sound wave pulse transmitted by the ADCP. Echo intensity can be used as an indicator of the amount of sediment or organisms in the water column, as well as of the quality of a velocity measurement. Units: dB',3,1);
INSERT INTO "parameter" VALUES(2749,'sci_seawater_density',10,1,NULL,124,NULL,'Seawater Density','sea_water_density',4,27,'{"lat": "PD1335", "p": "dpi_PRESWAT_L1", "SP": "dpi_PRACSAL_L2", "lon": "PD1336", "t": "PD1528"}','DENSITY_L2','The density of seawater in kg m-3 computed using the TEOS-10 equations with data from the conductivity, temperature and depth (CTD) family of instruments.',3,2);
INSERT INTO "parameter" VALUES(2750,'sci_abs_oxygen',10,1,NULL,221,NULL,'DO - Pressure Temp Sal Corrected (CTDGV)','moles_of_oxygen_per_unit_mass_in_sea_water',4,61,'{"DO": "PD1516", "SP": "dpi_PRACSAL_L2", "lon": "PD1336", "P": "dpi_PRESWAT_L1", "T": "PD1528", "lat": "PD1335"}','DOXYGEN_L2','Dissolved Oxygen (DO) Concentration from the Stable Response Dissolved Oxygen Instrument is a measure of the concentration of gaseous oxygen mixed in seawater. This instrument measures dissolved oxygen concentrations on mobile assets, deep profilers, and moorings. This data product is corrected for salinity, temperature, and depth from the glider CTD. Units: umol kg-1.',3,2);
