INSERT INTO "parameter" VALUES(2766,'spkir_abj_cspp_downwelling_vector',10,1,NULL,215,7,'Downwelling Spectral Irradiance',NULL,4,95,'{"counts": "PD2319", "scale": "CC_scale", "immersion_factor": "CC_immersion_factor", "offset": "CC_offset"}','SPECTIR_L1','Downwelling Spectral Irradiance is the measure of electromagnetic radiation per unit area received (i.e. incident) by a sensor within the seawater column. Downwelling spectral irradiance is calculated from measurements made across 7 specific, pre-defined wavebands as follows: 1 = 412nm, 2 = 443nm, 3 = 490nm, 4 = 510nm, 5 = 555nm, 6 = 620nm, 7 = 683nm.. Units: uW cm-2 nm-1',3,1);
INSERT INTO "parameter" VALUES(2767,'phsen_abcdef_ph_seawater',10,1,NULL,8,7,'pH of Seawater','sea_water_ph_reported_on_total_scale',4,48,'{"ind_slp": "CC_ind_slp", "therm": "PD938", "light": "PD357", "ea434": "CC_ea434", "eb434": "CC_eb434", "psal": "dpi_PRACSAL_L2", "ea578": "CC_ea578", "ind_off": "CC_ind_off", "ref": "PD933", "eb578": "CC_eb578"}','PHWATER_L1','pH is a measurement of the concentration of hydrogen ions in a solution. pH ranges from acidic to basic on a scale from 0 to 14 with 7 being neutral. Units: pH units',3,1);
INSERT INTO "parameter" VALUES(2769,'corrected_echo_intensity_beam1',10,1,NULL,71,7,'Echo Intensity Beam 1',NULL,4,89,'{"raw": "PD724", "sfactor": "CC_scale_factor1"}','ECHOINT-B1_L1','Echo intensity is the strength of the returned sound wave pulse transmitted by the ADCP. Echo intensity can be used as an indicator of the amount of sediment or organisms in the water column, as well as of the quality of a velocity measurement. Units: dB',3,1);
