INSERT INTO "parameter" VALUES(2771,'corrected_echo_intensity_beam3',10,1,NULL,71,7,'Echo Intensity Beam 3',NULL,4,89,'{"raw": "PD726", "sfactor": "CC_scale_factor3"}','ECHOINT-B3_L1','Echo intensity is the strength of the returned sound wave pulse transmitted by the ADCP. Echo intensity can be used as an indicator of the amount of sediment or organisms in the water column, as well as of the quality of a velocity measurement. Units: dB',3,1);
