INSERT INTO "parameter" VALUES(2805,'pco2_co2flux',10,1,NULL,181,7,'CO2 Flux from Ocean to Atmosphere',NULL,4,94,'{"u10": "PD3092", "pco2w": "PD1002", "s": "PD3077", "pco2a": "PD1003", "t": "PD1056"}','CO2FLUX_L2','Flux of CO2 from the Ocean into the Atmosphere refers to the exchange of CO2 between the sea surface and the overlying atmosphere. CO2 Flux is estimated from the difference between measurements of the partial pressure of CO2 in the surface ocean and the overlying air. The flux is then estimated as the proportional difference of these partial pressures. The proportionality factor is parameterized using wind speed and adjusted according to sea surface temperature and salinity. Units: mol m-2 s-1',3,2);
