INSERT INTO "parameter" VALUES(2808,'water_direction',3,1,NULL,98,7,'Direction (Calculated From VLE, VLN Corrected for EH Heading)',NULL,1,NULL,NULL,NULL,'1xN array of unsigned direction which is 000.0 to 359.9 degrees as measured toward the instrument and corrected for heading and magnetic deviation (EX11111) or the same with correction for pitch and roll (EX11011). Resolution 0.1 degrees',NULL,NULL);
INSERT INTO "parameter" VALUES(2809,'water_velocity',3,1,NULL,174,7,'Velocity (Calculated From VLE, VLN, VLU)',NULL,1,NULL,NULL,NULL,'1xN array of unsigned velocity which is the sqrt of the sum of the squares of E/W N/S and Up velocities. Resolution 0.1 mm/s',NULL,NULL);
INSERT INTO "parameter" VALUES(2810,'scaled_wave_burst_seafloor_pressure',10,1,NULL,80,7,'Seafloor Pressure','sea_water_pressure_at_sea_floor',4,132,'{"slope": "CC_slope_correction_factor", "ptcn": "PD96", "t4": "CC_t4", "t1": "CC_t1", "t2": "CC_t2", "p_dec_wave": "PD833", "u0": "CC_u0", "t3": "CC_t3", "c3": "CC_c3", "poff": "CC_pressure_offset_calibration_coefficient", "offset": "CC_offset_correction_factor", "y1": "CC_y1", "c2": "CC_c2", "y3": "CC_y3", "y2": "CC_y2", "d2": "CC_d2", "c1": "CC_c1", "d1": "CC_d1"}','SFLPRES-WAVE_L1','Seafloor Pressure is a measurement of the force on the seafloor exerted by the weight of the overlying seawater column plus the weight of the atmosphere (hydrostatic plus atmospheric). Units: dbar',3,1);
