INSERT INTO "parameter" VALUES(2820,'ctdbp_seawater_pressure',10,1,NULL,80,7,'Seawater Pressure','sea_water_pressure',3,36,'{"pa0": "CC_pa0", "ptca1": "CC_ptca1", "p0": "PD195", "pa1": "CC_pa1", "pa2": "CC_pa2", "t0": "PD196", "ptempa2": "CC_ptempa2", "ptca0": "CC_ptca0", "ptempa0": "CC_ptempa0", "ptempa1": "CC_ptempa1", "ptcb0": "CC_ptcb0", "ptcb1": "CC_ptcb1", "ptcb2": "CC_ptcb2", "ptca2": "CC_ptca2"}','PRESWAT_L1','Seawater Pressure refers to the pressure exerted on a sensor in situ by the weight of the column of seawater above it. It is calculated by subtracting one standard atmosphere from the absolute pressure at the sensor to remove the weight of the atmosphere on top of the water column. The pressure at a sensor in situ provides a metric of the depth of that sensor. Units: dbar',3,1);
INSERT INTO "parameter" VALUES(2821,'ctdbp_seawater_conductivity',10,1,NULL,36,7,'Seawater Conductivity','sea_water_electrical_conductivity',6,37,'{"p1": "PD2820", "g": "CC_g", "i": "CC_i", "h": "CC_h", "j": "CC_j", "ctcor": "CC_ctcor", "t1": "PD2819", "cpcor": "CC_cpcor", "c0": "PD194"}','CONDWAT_L1','Seawater conductivity refers to the ability of seawater to conduct electricity. The presence of ions in the seawater, such as salt, increases the electrical conducting ability of seawater. As such, conductivity can be used as a proxy for determining the quantity of salt in a sample of seawater. Units: S m-1',3,1);
INSERT INTO "parameter" VALUES(2824,'wavss_a_directional_frequency',10,1,NULL,22,7,'Directional Wave Spectral Bins',NULL,4,133,'{"nfreq_nondir": "wavss_a_dcl_non_directional.PD2787", "freq0": "PD2788", "delta_freq": "PD2789", "nfreq_dir": "PD2787"}','WAVSTAT-FDS_L1','Frequency values for directional wave spectral bins (WAVSTAT-FDS_L1) [Hz]',3,1);
INSERT INTO "parameter" VALUES(2825,'wavss_a_non_directional_frequency',10,1,NULL,22,7,'Non-Directional Wave Spectral Bins',NULL,4,134,'{"nfreq": "PD2787", "delta_freq": "PD2789", "freq0": "PD2788"}','WAVSTAT-FND_L1','Frequency values for non-directional wave spectral bins (WAVSTAT-FND_L1) [Hz]',3,1);
