INSERT INTO "parameter" VALUES(2834,'battery_low_blank',5,6,NULL,8,4,'Battery Low During Blank Cycle',NULL,0,NULL,NULL,NULL,'Battery low during blank cycle',NULL,NULL);
INSERT INTO "parameter" VALUES(2843,'dosta_abcdjm_cspp_tc_oxygen',10,1,NULL,220,7,'DO - Temp Corrected',NULL,NULL,59,'{"calphase": "PD943", "csv": "CC_csv", "temp": "PD942"}','DOCONCS_L1','Dissolved Oxygen (DO) Concentration from the Stable Response Dissolved Oxygen Instrument is a measure of the concentration of gaseous oxygen mixed in seawater. This instrument measures dissolved oxygen concentrations on mobile assets, deep profilers, and moorings.This data product is corrected for temperature measured by the DO instrument. Units: umol L-1.',3,1);
INSERT INTO "parameter" VALUES(2846,'flcdr_x_mmp_cds_fluorometric_cdom',10,1,NULL,189,7,'CDOM Concentration',NULL,6,79,'{"counts_dark": "CC_dark_counts_cdom", "scale_factor": "CC_scale_factor_cdom", "counts_output": "PD2257"}','CDOMFLO_L1','Fluorometric CDOM Concentration is a measure of how much light has been re-emitted (fluoresced) from colored organic compounds found in the colored dissolved organic matter (CDOM) in seawater. Examples of CDOM include tannins (polyphenols that bind to proteins and other large molecules) or lignins (polymers of phenolic acids) from decaying plant material and byproducts from the decomposition of animals. CDOM is not particulate, but seawater can contain both CDOM and turbidity. Units: ppb',3,1);
INSERT INTO "parameter" VALUES(2847,'flntu_x_mmp_cds_total_volume_scattering_coefficient',10,1,NULL,133,7,'Total Volume Scattering Coefficient',NULL,6,81,'{"counts_dark": "CC_dark_counts_volume_scatter", "scale_factor": "CC_scale_factor_volume_scatter", "counts_output": "PD2259"}','FLUBSCT_L1','The Total Volume Scattering Coefficient represents the volume scattering from particles and the molecular scattering from water at a given wavelength of light and the default angle of 117 degrees for the ECO meter. Units: m-1 sr-1',3,1);
INSERT INTO "parameter" VALUES(2848,'flntu_x_mmp_cds_fluorometric_chlorophyll_a',10,1,NULL,218,7,'Chlorophyll-A Concentration','mass_concentration_of_chlorophyll_a_in_sea_water',6,80,'{"counts_dark": "CC_dark_counts_chlorophyll_a", "scale_factor": "CC_scale_factor_chlorophyll_a", "counts_output": "PD2258"}','CHLAFLO_L1','Fluorometric Chlorophyll-a Concentration is an estimate of phytoplankton biomass using fluorescence. The fluorometer emits light at a specific wavelength that is absorbed by chlorophyll and re-emitted as light at a different wavelength. By measuring the intensity of the re-emitted wavelength the chlorophyll-a concentration in the surrounding seawater can be estimated. Chlorophyll-a concentrations can be used as a proxy for phytoplankton biomass because it is a dominant photosynthetic pigment. Units: ug L-1',3,1);
INSERT INTO "parameter" VALUES(2849,'flntu_x_mmp_cds_bback_total',10,1,NULL,132,7,'Optical Backscatter (Red Wavelengths)',NULL,4,78,'{"beta": "PD2847", "degC": "PD6", "theta": "CC_scattering_angle", "wlngth": "CC_measurement_wavelength", "xfactor": "CC_angular_resolution", "psu": "dpi_PRACSAL_L2"}','FLUBSCT_L2','Optical Backscatter (Red Wavelengths) is a measure of the amount of red light (630-740 nm wavelengths) scattered in the backward direction due to suspended matter within seawater, providing a proxy for turbidity and suspended solids. Units: m-1',3,2);
