INSERT INTO "parameter" VALUES(2926,'ctdmo_seawater_pressure',10,1,NULL,80,5,'Seawater Pressure','sea_water_pressure',NULL,142,'{"p0": "PD195", "p_range_psia": "CC_p_range"}','PRESWAT_L1','Seawater Pressure refers to the pressure exerted on a sensor in situ by the weight of the column of seawater above it. It is calculated by subtracting one standard atmosphere from the absolute pressure at the sensor to remove the weight of the atmosphere on top of the water column. The pressure at a sensor in situ provides a metric of the depth of that sensor. Units: dbar',3,1);
INSERT INTO "parameter" VALUES(2927,'ctdmo_seawater_temperature',10,1,NULL,91,7,'Seawater Temperature','sea_water_temperature',4,140,'{"t0": "PD193"}','TEMPWAT_L1','Seawater temperature near the sensor. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(2928,'ctdmo_seawater_conductivity',10,1,NULL,36,7,'Seawater Conductivity','sea_water_electrical_conductivity',4,141,'{"c0": "PD194"}','CONDWAT_L1','Seawater conductivity refers to the ability of seawater to conduct electricity. The presence of ions in the seawater, such as salt, increases the electrical conducting ability of seawater. As such, conductivity can be used as a proxy for determining the quantity of salt in a sample of seawater. Units: S m-1',3,1);
INSERT INTO "parameter" VALUES(2931,'number_of_beam_sequences',11,3,NULL,66,5,'Number of Beam Sequences Per Burst',NULL,0,NULL,NULL,NULL,'Number Of Beam Sequences Per Burst',NULL,NULL);
