INSERT INTO "parameter" VALUES(3067,'met_barpres',10,1,NULL,33,7,'Barometric Pressure','air_pressure',2,143,'{"mbar": "PD1051"}','BARPRES_L1','Barometric Pressure is a measure of the weight of the column of air above the sensor. It is also commonly referred to as atmospheric pressure. This data products is calculated by converting the measured Level 0 Barometric Pressure from mbar to Pa.',3,1);
INSERT INTO "parameter" VALUES(3068,'met_windavg_mag_corr_east',10,1,NULL,128,7,'Mean Wind Velocity - Eastward Relative to True North','eastward_wind',2,144,'{"zwindsp": "CC_height_of_windspeed_sensor_above_sealevel_m", "uu": "PD1059", "timestamp": "PD7", "lon": "CC_lon", "vv": "PD1060", "lat": "CC_lat"}','WINDAVG-VLE_L1','WINDAVG-VLE_L1, the OOI Level 1 core data product for windspeed in the true eastward direction, for the METBK instrument by correcting for magnetic declination.',3,1);
INSERT INTO "parameter" VALUES(3069,'met_windavg_mag_corr_north',10,1,NULL,128,7,'Mean Wind Velocity - Northward Relative to True North','northward_wind',2,145,'{"zwindsp": "CC_height_of_windspeed_sensor_above_sealevel_m", "uu": "PD1059", "timestamp": "PD7", "lon": "CC_lon", "vv": "PD1060", "lat": "CC_lat"}','WINDAVG-VLN_L1','WINDAVG-VLN_L1, the OOI Level 1 core data product for windspeed in the true northward direction, for the METBK instrument by correcting for magnetic declination.',3,1);
INSERT INTO "parameter" VALUES(3070,'met_current_direction',10,1,NULL,98,7,'Surface Current Direction',NULL,4,146,'{"vle_water": "PD1154", "use_velptmn_with_metbk": "CC_use_velpt", "vln_water": "PD1155"}','CURRENT_DIR','The direction of the surface current using the eastward and northward velocity components from the VELPT mounted on the surface buoy.',NULL,NULL);
INSERT INTO "parameter" VALUES(3071,'met_current_speed',10,1,NULL,128,7,'Surface Current Speed',NULL,4,147,'{"vle_water": "PD1154", "use_velptmn_with_metbk": "CC_use_velpt", "vln_water": "PD1155"}','CURRENT_SPD','Estimated magnitude of the surface current using the eastward and northward velocity components from the VELPT mounted on the surface buoy. This is the meta-data "product" CURRENT specified by the DPS referenced below (Section 4.3, step 4). This product is not used in the METBK code; rather, the magnitude of the vector difference of te wind and current vectors is the fundamental variable used in the METBK calculations (see RELWIND_SPD-AUX). Because the direction of the current will also be calculated so as to be made available, the CURRENT metadata product is sub-divided into: CURRENT_SPD (calculated by this code) and CURRENT_DIR.',NULL,NULL);
INSERT INTO "parameter" VALUES(3072,'met_relwind_direction',10,1,NULL,98,7,'Relative Wind Direction',NULL,4,148,'{"vln_wind": "PD3069", "vle_water": "PD1154", "use_velptmn_with_metbk": "CC_use_velpt", "vle_wind": "PD3068", "vln_water": "PD1155"}','RELWIND_DIR-AUX','RELWIND_DIR-AUX, the direction of the vector difference of wind velocity (from METBK measurements) and surface current (from VELPT measurements). It is anticipated that the wind measurements will be roughly each minute and that the current measurements will be broadcast to that resolution.',NULL,NULL);
INSERT INTO "parameter" VALUES(3073,'met_relwind_speed',10,1,NULL,128,7,'Relative Wind Speed',NULL,4,149,'{"vln_wind": "PD3069", "vle_water": "PD1154", "use_velptmn_with_metbk": "CC_use_velpt", "vle_wind": "PD3068", "vln_water": "PD1155"}','RELWIND_SPD-AUX','RELWIND_SPD-AUX, the magnitude of the vector difference of surface current (from VELPT measurements) from wind velocity (from METBK measurements). This is the fundamental windspeed variable used in the METBK toga-coare algorithms. It is anticipated that the wind measurements will be roughly each minute and that the current measurements will be broadcast to that resolution.',NULL,NULL);
INSERT INTO "parameter" VALUES(3074,'met_timeflx',10,1,NULL,205,7,'Hourly Averaged Timestamp',NULL,4,150,'{"timestamp": "PD7"}','TIMEFLX-AUX','TIMEFLX-AUX, the timestamps corresponding to the hourly averaged METBK data products. The units of the timestamps are seconds since 01-01-1900. The timestamp values are selected to be at the midpoint of the bin intervals, starting half an hour after the timestamp of the first data record to be processed. For example, if the first data record for 30 days of data is at 4:45 AM on a given day, the first timeflx stamp will be at 5:15 AM on that day, and all succeeding timestamps for the rest of the data will all be at 15 minutes past the hour.',NULL,NULL);
INSERT INTO "parameter" VALUES(3075,'met_netsirr',10,1,NULL,40,7,'Net Shortwave Irradiance',NULL,4,151,'{"shortwave_down": "PD1058"}','NETSIRR_L2','NETSIRR_L2, the OOI core data product net shortwave radiation in the downward direction, for the METBK instrument.',3,2);
INSERT INTO "parameter" VALUES(3076,'met_rainrte',10,1,NULL,175,7,'Rain Rate',NULL,4,152,'{"timestamp": "PD7", "cumulative_precipitation": "PD1055"}','RAINRTE_L2','RAINRTE_L2, the OOI core data product rain rate, for the METBK instrument. The DPS requires that the output data be hourly; METBK is set up to give roughly one data record per minute for the data needed to calculate RAINRTE.',3,2);
INSERT INTO "parameter" VALUES(3077,'met_salsurf',10,1,NULL,8,7,'Sea Surface Practical Salinity','sea_water_practical_salinity',4,153,'{"tC_sea": "dpi_TEMPSRF_L1", "cond": "dpi_CONDSRF_L1", "ztmpwat": "CC_depth_of_conductivity_and_temperature_measurements_m"}','SALSURF_L2','Salinity is generally defined as the concentration of dissolved salt in a parcel of seawater. Practical Salinity is a more specific unitless quantity calculated from the conductivity of seawater and adjusted for temperature and pressure. It is approximately equivalent to Absolute Salinity (the mass fraction of dissolved salt in seawater) but they are not interchangeable. Units: unitless',3,2);
INSERT INTO "parameter" VALUES(3078,'met_spechum',10,1,NULL,107,7,'Specific Humidity',NULL,4,154,'{"tC_air": "PD1053", "pr_air": "PD1051", "relhum": "PD1052"}','SPECHUM_L2','SPECHUM_L2, the OOI air specific humidity core data product, for the METBK instrument. Not to be confused with the SPHUM2M_L2 data product.',3,2);
INSERT INTO "parameter" VALUES(3079,'met_buoyfls',10,1,NULL,40,7,'Sonic Buoyancy Flux',NULL,4,155,'{"tC_air": "PD1053", "zwindsp": "CC_height_of_windspeed_sensor_above_sealevel_m", "zhumair": "CC_height_of_air_humidity_measurement_m", "wnd": "PD3073", "tC_sea": "PD1056", "lon": "CC_lon", "jcool": "CC_jcool", "ztmpair": "CC_height_of_air_temperature_measurement_m", "pr_air": "PD1051", "zinvpbl": "CC_zinvpbl", "cumu_prcp": "PD1055", "ztmpwat": "CC_depth_of_conductivity_and_temperature_measurements_m", "Rlong_down": "PD1054", "timestamp": "PD7", "lat": "CC_lat", "Rshort_down": "PD1058", "relhum": "PD1052", "jwarm": "CC_jwarm"}','BUOYFLS_L2','Calculated sonic buoyancy flux data product BUOYFLS_L2 using the sonic temperature instead of the virtual temperature. The FDCHP instrument calculates the analogous FLUXHOT_L2 data product also as a buoyancy flux using the sonic temperature. In contrast, the (METBK) data product BUOYFLX_L2 uses the virtual temperature in its calculation of buoyancy flux.',NULL,2);
INSERT INTO "parameter" VALUES(3080,'met_buoyflx',10,1,NULL,40,7,'Buoyancy Flux',NULL,4,156,'{"tC_air": "PD1053", "zwindsp": "CC_height_of_windspeed_sensor_above_sealevel_m", "zhumair": "CC_height_of_air_humidity_measurement_m", "wnd": "PD3073", "tC_sea": "PD1056", "lon": "CC_lon", "jcool": "CC_jcool", "ztmpair": "CC_height_of_air_temperature_measurement_m", "pr_air": "PD1051", "zinvpbl": "CC_zinvpbl", "cumu_prcp": "PD1055", "ztmpwat": "CC_depth_of_conductivity_and_temperature_measurements_m", "Rlong_down": "PD1054", "timestamp": "PD7", "lat": "CC_lat", "Rshort_down": "PD1058", "relhum": "PD1052", "jwarm": "CC_jwarm"}','BUOYFLX_L2','Calculated buoyancy flux data product BUOYFLX_L2 using the virtual temperature. This is the more fundamental quantity for buoyancy flux (rather than using the sonic temperature).',NULL,2);
INSERT INTO "parameter" VALUES(3081,'met_frshflx',10,1,NULL,175,7,'Freshwater Flux',NULL,4,157,'{"tC_air": "PD1053", "zwindsp": "CC_height_of_windspeed_sensor_above_sealevel_m", "zhumair": "CC_height_of_air_humidity_measurement_m", "wnd": "PD3073", "tC_sea": "PD1056", "lon": "CC_lon", "jcool": "CC_jcool", "ztmpair": "CC_height_of_air_temperature_measurement_m", "pr_air": "PD1051", "zinvpbl": "CC_zinvpbl", "cumu_prcp": "PD1055", "ztmpwat": "CC_depth_of_conductivity_and_temperature_measurements_m", "Rlong_down": "PD1054", "timestamp": "PD7", "lat": "CC_lat", "Rshort_down": "PD1058", "relhum": "PD1052", "jwarm": "CC_jwarm"}','FRSHFLX_L2','The freshwater upward flux data product FRSHFLX_L2.',3,2);
INSERT INTO "parameter" VALUES(3082,'met_heatflx',10,1,NULL,40,7,'Net Heat Flux',NULL,4,158,'{"tC_air": "PD1053", "zwindsp": "CC_height_of_windspeed_sensor_above_sealevel_m", "zhumair": "CC_height_of_air_humidity_measurement_m", "wnd": "PD3073", "tC_sea": "PD1056", "lon": "CC_lon", "jcool": "CC_jcool", "ztmpair": "CC_height_of_air_temperature_measurement_m", "pr_air": "PD1051", "zinvpbl": "CC_zinvpbl", "cumu_prcp": "PD1055", "ztmpwat": "CC_depth_of_conductivity_and_temperature_measurements_m", "Rlong_down": "PD1054", "timestamp": "PD7", "lat": "CC_lat", "Rshort_down": "PD1058", "relhum": "PD1052", "jwarm": "CC_jwarm"}','HEATFLX_L2','The total net upward heat flux data product HEATFLX_L2.',3,2);
INSERT INTO "parameter" VALUES(3083,'met_latnflx',10,1,NULL,40,7,'Latent Heat Flux',NULL,4,159,'{"tC_air": "PD1053", "zwindsp": "CC_height_of_windspeed_sensor_above_sealevel_m", "zhumair": "CC_height_of_air_humidity_measurement_m", "wnd": "PD3073", "tC_sea": "PD1056", "lon": "CC_lon", "jcool": "CC_jcool", "ztmpair": "CC_height_of_air_temperature_measurement_m", "pr_air": "PD1051", "zinvpbl": "CC_zinvpbl", "cumu_prcp": "PD1055", "ztmpwat": "CC_depth_of_conductivity_and_temperature_measurements_m", "Rlong_down": "PD1054", "timestamp": "PD7", "lat": "CC_lat", "Rshort_down": "PD1058", "relhum": "PD1052", "jwarm": "CC_jwarm"}','LATNFLX_L2','The upward latent heat flux data product LATNFLX_L2.',3,2);
