INSERT INTO "parameter" VALUES(3230,'velpt_d_eastward_velocity',10,1,NULL,128,7,'Eastward Mean Point Seawater Velocity','eastward_sea_water_velocity',3,106,'{"lat": "CC_lat", "lon": "CC_lon", "u": "PD441", "timestamp": "PD7", "v": "PD442"}','VELPTMN-VLE_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the eastward component of mean point seawater velocity in earth coordinates relative to true north (accounted for magnetic variation). Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(3231,'velpt_d_northward_velocity',10,1,NULL,128,7,'Northward Mean Point Seawater Velocity','northward_sea_water_velocity',3,105,'{"lat": "CC_lat", "lon": "CC_lon", "u": "PD441", "timestamp": "PD7", "v": "PD442"}','VELPTMN-VLN_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the northward component of mean point seawater velocity in earth coordinates relative to true north (accounted for magnetic variation). Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(3232,'velpt_d_upward_velocity',10,1,NULL,128,7,'Upward Mean Point Seawater Velocity','upward_sea_water_velocity',3,107,'{"w": "PD443"}','VELPTMN-VLU_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the upward component of mean point seawater velocity. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(3233,'vel3d_k_eastward_velocity',10,1,NULL,128,7,'Eastward Mean Point Seawater Velocity','eastward_sea_water_velocity',NULL,169,'{"timestamp": "PD7", "beams": "PD2010", "lon": "CC_lon", "heading": "PD1609", "vel2": "PD1615", "Vscale": "PD1612", "pitch": "PD1610", "lat": "CC_lat", "roll": "PD1611", "vel1": "PD1614", "vel0": "PD1613"}','VELPTMN-VLE_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the eastward component of mean point seawater velocity in earth coordinates relative to true north (accounted for magnetic variation). Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(3234,'vel3d_k_northward_velocity',10,1,NULL,128,7,'Northward Mean Point Seawater Velocity','northward_sea_water_velocity',NULL,170,'{"timestamp": "PD7", "beams": "PD2010", "lon": "CC_lon", "heading": "PD1609", "vel2": "PD1615", "Vscale": "PD1612", "pitch": "PD1610", "lat": "CC_lat", "roll": "PD1611", "vel1": "PD1614", "vel0": "PD1613"}','VELPTMN-VLN_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the northward component of mean point seawater velocity in earth coordinates relative to true north (accounted for magnetic variation). Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(3235,'vel3d_k_upward_velocity',10,1,NULL,128,7,'Upward Mean Point Seawater Velocity','upward_sea_water_velocity',NULL,171,'{"beams": "PD2010", "heading": "PD1609", "vel2": "PD1615", "Vscale": "PD1612", "pitch": "PD1610", "roll": "PD1611", "vel1": "PD1614", "vel0": "PD1613"}','VELPTMN-VLU_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the upward component of mean point seawater velocity. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(3236,'parad_j_par_counts_output',10,1,NULL,222,8,'Photosynthetically Active Radiation','downwelling_photosynthetic_photon_flux_in_sea_water',4,172,'{"a1": "CC_a1", "a0": "CC_a0", "Im": "CC_Im", "counts_output": "PD188"}','OPTPARW_L1','Photosynthetically Active Radiation (PAR) is the measure of the density of photons per unit area that are in the spectral range of light (400-700 nanometers) that primary producers use for photosynthesis. Units: umol photons m-2 s-1',3,1);
