INSERT INTO "parameter" VALUES(3483,'vel3d_a_eastward_velocity',10,1,NULL,128,7,'Eastward Mean Point Seawater Velocity',NULL,4,173,'{"hx": "PD2252", "hy": "PD2253", "vp1": "PD2248", "hy_cal": "CC_hy_cal", "vp3": "PD2250", "timestamp": "PD7", "lon": "CC_lon", "lat": "CC_lat", "hx_cal": "CC_hx_cal", "hdg_cal": "CC_hdg_cal"}','VELPTMN-VLE_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the eastward component of mean point seawater velocity in earth coordinates relative to true north (accounted for magnetic variation). Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(3484,'vel3d_a_northward_velocity',10,1,NULL,128,7,'Northward Mean Point Seawater Velocity',NULL,4,174,'{"hx": "PD2252", "hy": "PD2253", "vp1": "PD2248", "hy_cal": "CC_hy_cal", "vp3": "PD2250", "timestamp": "PD7", "lon": "CC_lon", "lat": "CC_lat", "hx_cal": "CC_hx_cal", "hdg_cal": "CC_hdg_cal"}','VELPTMN-VLN_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the northward component of mean point seawater velocity in earth coordinates relative to true north (accounted for magnetic variation). Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(3485,'vel3d_a_upward_velocity_ascending',10,1,NULL,128,7,'Upward Mean Point Seawater Velocity - Ascending',NULL,4,177,'{"vp4": "PD2251", "vp1": "PD2248", "vp3": "PD2250"}','VELPTMN-VLU-ASC_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the upward component of mean point seawater velocity when the profiler is ascending. Units: m s-1',3,1);
