INSERT INTO "parameter" VALUES(3647,'ctdbp_no_seawater_pressure',10,1,NULL,80,7,'Seawater Pressure','sea_water_pressure',3,96,'{"p0": "PD195", "T4": "CC_T4", "T5": "CC_T5", "T2": "CC_T2", "T3": "CC_T3", "t0": "PD196", "T1": "CC_T1", "C3": "CC_C3", "C2": "CC_C2", "C1": "CC_C1", "D2": "CC_D2", "D1": "CC_D1"}','PRESWAT_L1','Seawater Pressure refers to the pressure exerted on a sensor in situ by the weight of the column of seawater above it. It is calculated by subtracting one standard atmosphere from the absolute pressure at the sensor to remove the weight of the atmosphere on top of the water column. The pressure at a sensor in situ provides a metric of the depth of that sensor. Units: dbar',3,1);
INSERT INTO "parameter" VALUES(3648,'ctdbp_no_seawater_conductivity',10,1,NULL,36,7,'Seawater Conductivity','sea_water_electrical_conductivity',6,37,'{"p1": "PD3647", "g": "CC_g", "i": "CC_i", "h": "CC_h", "j": "CC_j", "ctcor": "CC_ctcor", "t1": "PD908", "cpcor": "CC_cpcor", "c0": "PD194"}','CONDWAT_L1','Seawater conductivity refers to the ability of seawater to conduct electricity. The presence of ions in the seawater, such as salt, increases the electrical conducting ability of seawater. As such, conductivity can be used as a proxy for determining the quantity of salt in a sample of seawater. Units: S m-1',3,1);
INSERT INTO "parameter" VALUES(3652,'velpt_j_eastward_velocity',10,1,NULL,128,7,'Eastward Mean Point Seawater Velocity',NULL,4,55,'{"lat": "CC_lat", "lon": "CC_lon", "u": "PD2608", "timestamp": "PD7", "v": "PD2609"}','VELPTMN-VLE_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the eastward component of mean point seawater velocity in earth coordinates relative to true north (accounted for magnetic variation). Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(3653,'velpt_j_northward_velocity',10,1,NULL,128,7,'Northward Mean Point Seawater Velocity',NULL,4,56,'{"lat": "CC_lat", "lon": "CC_lon", "u": "PD2608", "timestamp": "PD7", "v": "PD2609"}','VELPTMN-VLN_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the northward component of mean point seawater velocity in earth coordinates relative to true north (accounted for magnetic variation). Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(3654,'velpt_j_upward_velocity',10,1,NULL,128,7,'Upward Mean Point Seawater Velocity',NULL,4,58,'{"w": "PD2610"}','VELPTMN-VLU_L1','Mean Point Seawater Velocity refers to the velocity (speed and direction) of a single "point" of water (in this case, a volume of several square meters) averaged over time-scales associated with surface gravity waves. This instrument estimates water velocity by measuring the Doppler shift of acoustic signals reflected by particles suspended in the water. This data product is the upward component of mean point seawater velocity. Units: m s-1',3,1);
INSERT INTO "parameter" VALUES(3655,'botsflu_time15s',10,2,NULL,204,7,'Seafloor Uplift and Deflation - Timestamp 15s',NULL,4,179,'{"timestamp": "PD7"}','TIME15S','These auxiliary data products are timestamps anchored at multiples of 15 seconds past the minute which correspond to the time base for the BOTSFLU data products which are binned on 15 seconds.',1,NULL);
INSERT INTO "parameter" VALUES(3656,'botsflu_meanpres',10,1,NULL,192,7,'Seafloor Uplift and Deflation - Mean Seafloor Pressure',NULL,4,180,'{"timestamp": "PD7", "botpres": "PD848"}','BOTSFLU-MEANPRES','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is 15-second mean seafloor pressure. Units: psi.',3,2);
INSERT INTO "parameter" VALUES(3657,'botsflu_meandepth',10,1,NULL,127,7,'Seafloor Uplift and Deflation - Mean Seafloor Depth',NULL,4,181,'{"timestamp": "PD7", "botpres": "PD848"}','BOTSFLU-MEANDEPTH','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is derived by conversion of the 15-second mean seafloor pressure and removal of the tidal signal predicted for the BOTPT instrument location. Units: meters.',3,2);
INSERT INTO "parameter" VALUES(3658,'botsflu_5minrate',10,1,NULL,61,7,'Seafloor Uplift and Deflation - 5-Min Rate of Depth Change',NULL,4,182,'{"timestamp": "PD7", "botpres": "PD848"}','BOTSFLU-5MINRATE','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is the instantaneous rate of depth change derived from the 15-sec Mean Seafloor Depth Detided using a backward-looking 5 minute reference point for the depth difference. Units: cm m-1',3,2);
INSERT INTO "parameter" VALUES(3659,'botsflu_10minrate',10,1,NULL,60,7,'Seafloor Uplift and Deflation - 10-Min Mean Seafloor Uplift Rate',NULL,4,183,'{"timestamp": "PD7", "botpres": "PD848"}','BOTSFLU-10MINRATE','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product utilizes the 15-second Mean Seafloor Depth Detided and calculates a mean for each data point over a 10 minute backward-looking window. The rate is derived from the backward-looking depth difference between values with a 10 minute offset. Units: cm h-1',3,2);
INSERT INTO "parameter" VALUES(3660,'botsflu_time24h',10,2,NULL,204,7,'Seafloor Uplift and Deflation - Timestamp 24h',NULL,4,184,'{"time15s": "PD3655"}','TIME24H','These auxiliary data products are timestamps anchored at 00:00 hours GMT which correspond to the time base for the BOTSFLU data products which are binned on a day''s worth of data.',1,NULL);
INSERT INTO "parameter" VALUES(3661,'botsflu_daydepth',10,1,NULL,127,7,'Seafloor Uplift and Deflation - Daily Mean Seafloor Depth',NULL,4,185,'{"timestamp": "PD7", "botpres": "PD848"}','BOTSFLU-DAYDEPTH','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is calculated using a 24-hour window centered on 00:00 hours GMT and applied to 15-sec Mean Deafloor Depth Detided data. It is corrected for pressure sensor drift annually, or biennially, using ROV-based field measurements. Units: meters.',3,2);
INSERT INTO "parameter" VALUES(3662,'botsflu_4wkrate',10,1,NULL,63,7,'Seafloor Uplift and Deflation - 4-Week Mean Rate of Seafloor Uplift',NULL,4,186,'{"timestamp": "PD7", "botpres": "PD848"}','BOTSFLU-4WKRATE','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is the mean rate of seafloor depth change as calculated by 4-week backwards-looking linear regressions. Uplift is positive. Units: cm yr-1.',3,2);
INSERT INTO "parameter" VALUES(3663,'botsflu_8wkrate',10,1,NULL,63,7,'Seafloor Uplift and Deflation - 8-Week Mean Rate of Seafloor Uplift',NULL,4,187,'{"timestamp": "PD7", "botpres": "PD848"}','BOTSFLU-8WKRATE','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is the mean rate of seafloor depth change as calculated by 8-week backwards-looking linear regressions. Uplift is positive. Units: cm yr-1.',3,2);
INSERT INTO "parameter" VALUES(3664,'botsflu_predtide',10,1,NULL,127,7,'Seafloor Uplift and Deflation - Predicted Tide',NULL,4,188,'{"time": "PD3655"}','BOTSFLU-PREDTIDE','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is the tide calculated at 15-second time intervals for the location of each BOTPT instrument using tide-prediction software. Units: meters.',3,2);
INSERT INTO "parameter" VALUES(3666,'ctdpf_ckl_mmp_cds_seawater_conductivity',10,1,NULL,36,7,'Seawater Conductivity','sea_water_electrical_conductivity',6,189,'{"scaler": 0.1, "value": "PD1552"}','CONDWAT_L1','Seawater conductivity refers to the ability of seawater to conduct electricity. The presence of ions in the seawater, such as salt, increases the electrical conducting ability of seawater. As such, conductivity can be used as a proxy for determining the quantity of salt in a sample of seawater. Units: S m-1',3,1);
