INSERT INTO "parameter" VALUES(3716,'fdchp_a_tmpatur',10,1,NULL,91,7,'Turbulent Air Temperature',NULL,4,190,'{"timestamp": "PD7", "sonicT": "PD1053"}','TMPATUR_L1','Turbulent Air Temperature refers to air temperature associated with eddies that flow over the ocean surface and is used to determine vertical fluxes of heat associated with the eddies. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(3717,'fdchp_a_windtur_north',10,1,NULL,128,7,'Wind Velocity - Northerly',NULL,4,191,'{"rateZ": "PD3323", "timestamp": "PD7", "heading": "PD3480", "accY": "PD3476", "accX": "PD3475", "accZ": "PD3477", "lat": "CC_latitude", "sonicU": "PD3471", "sonicV": "PD3472", "sonicW": "PD3473", "rateY": "PD3322", "rateX": "PD3321"}','WINDTUR-VLN_L1','The L1 windspeed data product WINDTUR-VLN_L1 from the FDCHP instrument, which collects 20 minutes of data every hour. The L1 data consists of these values less 30 seconds from both the beginning and end of each 12000 point dataset.',NULL,1);
INSERT INTO "parameter" VALUES(3718,'fdchp_a_windtur_up',10,1,NULL,128,7,'Wind Velocity - Vertical',NULL,4,192,'{"rateZ": "PD3323", "timestamp": "PD7", "heading": "PD3480", "accY": "PD3476", "accX": "PD3475", "accZ": "PD3477", "lat": "CC_latitude", "sonicU": "PD3471", "sonicV": "PD3472", "sonicW": "PD3473", "rateY": "PD3322", "rateX": "PD3321"}','WINDTUR-VLU_L1','The L1 windspeed data product WINDTUR-VLU_L1 from the FDCHP instrument, which collects 20 minutes of data every hour. The L1 data consists of these values less 30 seconds from both the beginning and end of each 12000 point dataset.',NULL,1);
INSERT INTO "parameter" VALUES(3719,'fdchp_a_windtur_west',10,1,NULL,128,7,'Wind Velocity - Westerly',NULL,4,193,'{"rateZ": "PD3323", "timestamp": "PD7", "heading": "PD3480", "accY": "PD3476", "accX": "PD3475", "accZ": "PD3477", "lat": "CC_latitude", "sonicU": "PD3471", "sonicV": "PD3472", "sonicW": "PD3473", "rateY": "PD3322", "rateX": "PD3321"}','WINDTUR-VLW_L1','The L1 windspeed data product WINDTUR-VLW_L1 from the FDCHP instrument, which collects 20 minutes of data every hour. The L1 data consists of these values less 30 seconds from both the beginning and end of each 12000 point dataset.',NULL,1);
INSERT INTO "parameter" VALUES(3720,'fdchp_a_fluxhot',10,1,NULL,129,7,'Direct Covariance Flux of Heat',NULL,4,194,'{"rateZ": "PD3323", "timestamp": "PD7", "sonicW": "PD3473", "accX": "PD3475", "rateY": "PD3322", "accZ": "PD3477", "lat": "CC_latitude", "accY": "PD3476", "rateX": "PD3321", "sonicV": "PD3472", "heading": "PD3480", "sonicT": "PD3474", "sonicU": "PD3471"}','FLUXHOT_L2','FLUXHOT_L2, the sonic buoyancy flux, from the FDCHP instrument, which collects 20 minutes of data every hour. There is one FLUXHOT value calculated for each 20 minute dataset of 12000 data records.',3,2);
INSERT INTO "parameter" VALUES(3721,'fdchp_a_fluxmom_alongwind',10,1,NULL,137,7,'Along-Wind Component of Momentum Flux',NULL,4,195,'{"rateZ": "PD3323", "timestamp": "PD7", "heading": "PD3480", "accY": "PD3476", "accX": "PD3475", "accZ": "PD3477", "lat": "CC_latitude", "sonicU": "PD3471", "sonicV": "PD3472", "sonicW": "PD3473", "rateY": "PD3322", "rateX": "PD3321"}','FLUXMOM-U_L2','FLUXMOM-U_L2, the along-wind component of the momentum flux, from the FDCHP instrument, which collects 20 minutes of data every hour. There is one FLUXMOM-U_L2 value calculated for each 20 minute dataset of 12000 data records.',NULL,2);
INSERT INTO "parameter" VALUES(3722,'fdchp_a_fluxmom_crosswind',10,1,NULL,137,7,'Cross-Wind Component of Momentum Flux',NULL,4,196,'{"rateZ": "PD3323", "timestamp": "PD7", "heading": "PD3480", "accY": "PD3476", "accX": "PD3475", "accZ": "PD3477", "lat": "CC_latitude", "sonicU": "PD3471", "sonicV": "PD3472", "sonicW": "PD3473", "rateY": "PD3322", "rateX": "PD3321"}','FLUXMOM-V_L2','FLUXMOM-V_L2, the cross-wind component of the momentum flux, from the FDCHP instrument, which collects 20 minutes of data every hour. There is one FLUXMOM-V_L2 value calculated for each 20 minute dataset of 12000 data records.',NULL,2);
INSERT INTO "parameter" VALUES(3723,'fdchp_a_time_L1',10,1,NULL,199,7,'L1 Timestamps',NULL,4,197,'{"timestamp": "PD7"}','TIME_L1-AUX','The time metadata product TIME_L1-AUX associated with the L1 wind and temperature data products from the FDCHP instrument, which collects 20 minutes of data every hour. For each of the L1 data products, 30 seconds of data is stripped out from the beginning and end of each 20 minute, 12000 record dataset. The TIME_L1-AUX values are the remaining timestamps for each dataset.',NULL,NULL);
INSERT INTO "parameter" VALUES(3724,'fdchp_a_time_L2',10,1,NULL,199,7,'L2 Timestamps',NULL,4,198,'{"timestamp": "PD7"}','TIME_L2-AUX','The time metadata product TIME_L2-AUX associated with the L2 flux data products from the FDCHP instrument. FDCHP collects 20 minutes of data every hour; for each of the L2 flux data products, one data value is calculated for each 20 minute dataset. The TIME_L2-AUX values are the median timestamps for each dataset.',NULL,NULL);
