INSERT INTO "parameter" VALUES(3746,'zplsc_c_pressure',11,1,NULL,73,7,'Seawater Pressure',NULL,1,NULL,NULL,NULL,'Seawater Pressure refers to the pressure exerted on a sensor in situ by the weight of the column of seawater above it. It is calculated by subtracting one standard atmosphere from the absolute pressure at the sensor to remove the weight of the atmosphere on top of the water column. The pressure at a sensor in situ provides a metric of the depth of that sensor. Units: dbar',NULL,NULL);
