INSERT INTO "parameter" VALUES(3777,'corrected_dissolved_oxygen',10,1,NULL,221,7,'DO - Pressure Temp Sal Corrected (CTD)',NULL,4,87,'{"Voffset": "CC_frequency_offset", "A": "CC_residual_temperature_correction_factor_a", "Soc": "CC_oxygen_signal_slope", "B": "CC_residual_temperature_correction_factor_b", "E": "CC_residual_temperature_correction_factor_e", "voltage_counts": "PD2310", "SP": "dpi_PRACSAL_L2", "lon": "CC_lon", "C": "CC_residual_temperature_correction_factor_c", "P": "PD909", "T": "PD908", "lat": "CC_lat"}','DOCONCF_L2','Dissolved Oxygen (DO) Concentration from the Fast Response (Fastrep) Dissolved Oxygen Instrument is a measure of the concentration of gaseous oxygen mixed in seawater. This Instrument measures dissolved oxygen concentrations on shallow coastal profilers through rapid oxygen gradients.This data product is corrected for salinity, temperature, and depth from a collocated CTD. Units: umol kg-1.',3,2);
