INSERT INTO "parameter" VALUES(7986,'parad_m_par',10,1,NULL,222,NULL,'Photosynthetically Active Radiation','downwelling_photosynthetic_photon_flux_in_sea_water',4,189,'{"scaler": "CC_bsipar_par_scaling", "value": "PD1470"}','OPTPARW_L1','Photosynthetically Active Radiation (PAR) is the measure of the density of photons per unit area that are in the spectral range of light (400-700 nanometers) that primary producers use for photosynthesis. Units: umol photons m-2 s-1',3,1);
INSERT INTO "parameter" VALUES(7987,'ctdmo_seawater_pressure',10,1,NULL,80,5,'Seawater Pressure','sea_water_pressure',NULL,205,'{"pa0": "CC_pa0", "ptca1": "CC_ptca1", "p0": "PD195", "pa1": "CC_pa1", "pa2": "CC_pa2", "ptempa2": "CC_ptempa2", "ptca0": "CC_ptca0", "ptempa0": "CC_ptempa0", "ptempa1": "CC_ptempa1", "ptcb0": "CC_ptcb0", "ptcb1": "CC_ptcb1", "ptcb2": "CC_ptcb2", "ptca2": "CC_ptca2", "pt0": "PD196"}','PRESWAT_L1','Seawater Pressure refers to the pressure exerted on a sensor in situ by the weight of the column of seawater above it. It is calculated by subtracting one standard atmosphere from the absolute pressure at the sensor to remove the weight of the atmosphere on top of the water column. The pressure at a sensor in situ provides a metric of the depth of that sensor. Units: dbar',3,1);
INSERT INTO "parameter" VALUES(7988,'ctdmo_seawater_temperature',10,1,NULL,91,7,'Seawater Temperature','sea_water_temperature',4,206,'{"a1": "CC_a1", "a0": "CC_a0", "a3": "CC_a3", "a2": "CC_a2", "t0": "PD193"}','TEMPWAT_L1','Seawater temperature near the sensor. Units: degrees Celsius',3,1);
INSERT INTO "parameter" VALUES(7989,'ctdmo_seawater_conductivity',10,1,NULL,36,7,'Seawater Conductivity','sea_water_electrical_conductivity',4,207,'{"p1": "PD7987", "g": "CC_g", "i": "CC_i", "h": "CC_h", "j": "CC_j", "ctcor": "CC_ctcor", "t1": "PD7988", "wbotc": "CC_wbotc", "cpcor": "CC_cpcor", "c0": "PD194"}','CONDWAT_L1','Seawater conductivity refers to the ability of seawater to conduct electricity. The presence of ions in the seawater, such as salt, increases the electrical conducting ability of seawater. As such, conductivity can be used as a proxy for determining the quantity of salt in a sample of seawater. Units: S m-1',3,1);
