INSERT INTO "parameter" VALUES(8058,'botsflu_time15s',11,2,NULL,204,7,'Seafloor Uplift and Deflation - Timestamp 15s',NULL,4,NULL,NULL,'TIME15S','These auxiliary data products are timestamps anchored at multiples of 15 seconds past the minute which correspond to the time base for the BOTSFLU data products which are binned on 15 seconds.',1,NULL);
INSERT INTO "parameter" VALUES(8059,'botsflu_meanpres',11,1,NULL,192,7,'Seafloor Uplift and Deflation - Mean Seafloor Pressure',NULL,4,NULL,NULL,'BOTSFLU-MEANPRES','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is 15-second mean seafloor pressure. Units: psi.',3,2);
INSERT INTO "parameter" VALUES(8060,'botsflu_meandepth',11,1,NULL,127,7,'Seafloor Uplift and Deflation - Mean Seafloor Depth',NULL,4,NULL,NULL,'BOTSFLU-MEANDEPTH','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is derived by conversion of the 15-second mean seafloor pressure and removal of the tidal signal predicted for the BOTPT instrument location. Units: meters.',3,2);
INSERT INTO "parameter" VALUES(8061,'botsflu_5minrate',11,1,NULL,61,7,'Seafloor Uplift and Deflation - 5-Min Rate of Depth Change',NULL,4,NULL,NULL,'BOTSFLU-5MINRATE','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is the instantaneous rate of depth change derived from the 15-sec Mean Seafloor Depth Detided using a backward-looking 5 minute reference point for the depth difference. Units: cm m-1',3,2);
INSERT INTO "parameter" VALUES(8062,'botsflu_10minrate',11,1,NULL,60,7,'Seafloor Uplift and Deflation - 10-Min Mean Seafloor Uplift Rate',NULL,4,NULL,NULL,'BOTSFLU-10MINRATE','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product utilizes the 15-second Mean Seafloor Depth Detided and calculates a mean for each data point over a 10 minute backward-looking window. The rate is derived from the backward-looking depth difference between values with a 10 minute offset. Units: cm h-1',3,2);
INSERT INTO "parameter" VALUES(8063,'botsflu_time24h',11,2,NULL,204,7,'Seafloor Uplift and Deflation - Timestamp 24h',NULL,4,NULL,NULL,'TIME24H','These auxiliary data products are timestamps anchored at 00:00 hours GMT which correspond to the time base for the BOTSFLU data products which are binned on a day''s worth of data.',1,NULL);
INSERT INTO "parameter" VALUES(8064,'botsflu_daydepth',11,1,NULL,127,7,'Seafloor Uplift and Deflation - Daily Mean Seafloor Depth',NULL,4,NULL,NULL,'BOTSFLU-DAYDEPTH','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is calculated using a 24-hour window centered on 00:00 hours GMT and applied to 15-sec Mean Deafloor Depth Detided data. It is corrected for pressure sensor drift annually, or biennially, using ROV-based field measurements. Units: meters.',3,2);
INSERT INTO "parameter" VALUES(8065,'botsflu_4wkrate',11,1,NULL,63,7,'Seafloor Uplift and Deflation - 4-Week Mean Rate of Seafloor Uplift',NULL,4,NULL,NULL,'BOTSFLU-4WKRATE','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is the mean rate of seafloor depth change as calculated by 4-week backwards-looking linear regressions. Uplift is positive. Units: cm yr-1.',3,2);
INSERT INTO "parameter" VALUES(8066,'botsflu_8wkrate',11,1,NULL,63,7,'Seafloor Uplift and Deflation - 8-Week Mean Rate of Seafloor Uplift',NULL,4,NULL,NULL,'BOTSFLU-8WKRATE','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is the mean rate of seafloor depth change as calculated by 8-week backwards-looking linear regressions. Uplift is positive. Units: cm yr-1.',3,2);
INSERT INTO "parameter" VALUES(8067,'botsflu_predtide',11,1,NULL,127,7,'Seafloor Uplift and Deflation - Predicted Tide',NULL,4,NULL,NULL,'BOTSFLU-PREDTIDE','Seafloor Uplift and Deflation is a measure of the inflation and deflation (i.e., "breathing") of the seafloor. These data are calculated using Nano-resolution Bottom Pressure. This data product is the tide calculated at 15-second time intervals for the location of each BOTPT instrument using tide-prediction software. Units: meters.',3,2);
