BEGIN TRANSACTION;
CREATE TABLE code_set (
	id INTEGER NOT NULL, 
	value VARCHAR(500) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (value)
);
CREATE TABLE data_product_type (
	id INTEGER NOT NULL, 
	value VARCHAR(50) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (value)
);
CREATE TABLE dimension (
	id INTEGER NOT NULL, 
	value VARCHAR(100) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (value)
);
CREATE TABLE fill_value (
	id INTEGER NOT NULL, 
	value VARCHAR(20) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (value)
);
CREATE TABLE function_type (
	id INTEGER NOT NULL, 
	value VARCHAR(250) NOT NULL, 
	PRIMARY KEY (id), 
	UNIQUE (value)
);
CREATE TABLE nominal_depth (
	id INTEGER NOT NULL, 
	subsite VARCHAR NOT NULL, 
	node VARCHAR NOT NULL, 
	sensor VARCHAR NOT NULL, 
	depth INTEGER, 
	PRIMARY KEY (id), 
	UNIQUE (subsite, node, sensor)
);
CREATE TABLE parameter (
	id INTEGER NOT NULL, 
	name VARCHAR(250) NOT NULL, 
	parameter_type_id INTEGER, 
	value_encoding_id INTEGER, 
	code_set_id INTEGER, 
	unit_id INTEGER, 
	fill_value_id INTEGER, 
	display_name VARCHAR(4096), 
	standard_name VARCHAR(4096), 
	precision INTEGER, 
	parameter_function_id INTEGER, 
	parameter_function_map VARCHAR, 
	data_product_identifier VARCHAR(250), 
	description VARCHAR(4096), 
	data_product_type_id INTEGER, 
	data_level INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(parameter_type_id) REFERENCES parameter_type (id), 
	FOREIGN KEY(value_encoding_id) REFERENCES value_encoding (id), 
	FOREIGN KEY(code_set_id) REFERENCES code_set (id), 
	FOREIGN KEY(unit_id) REFERENCES unit (id), 
	FOREIGN KEY(fill_value_id) REFERENCES fill_value (id), 
	FOREIGN KEY(parameter_function_id) REFERENCES parameter_function (id), 
	FOREIGN KEY(data_product_type_id) REFERENCES data_product_type (id)
);
